INSERT INTO `tbl_cms` VALUES ('33', 'DOH', '<p align=\"center\"><img src=\"plmis_src/operations/img/LMIS poster.jpg\" alt=\"\" />&nbsp; 								<strong>Department of Health </strong></p>\r\nThe Department of Health aims to bring                                  about the country\'s social and economic                                  development through rational choices about                                  Family size and reproductive behavior. The focus                                  of the Program is to consistently improve and                                  enrich the lives of individuals, families and                                  communities in accordance with the Reproductive                                    Health program.', '0', '0', '0', '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('34', 'MOPW', '<div class=WordSection1>\r\n\r\n<p class=MsoNormal><b><span style=\'font-size:13.5pt;font-family:\"Tahoma\",\"sans-serif\";\r\nmso-fareast-font-family:\"Times New Roman\";color:black\'>About TB Control Program<o:p></o:p></span></b></p>\r\n\r\n<div class=MsoNormal align=center style=\'text-align:center\'><span\r\nstyle=\'font-size:8.5pt;font-family:\"Tahoma\",\"sans-serif\";mso-fareast-font-family:\r\n\"Times New Roman\";color:white\'>\r\n\r\n<hr size=1 width=\"100%\" noshade style=\'color:#A0A0A0\' align=center>\r\n\r\n</span></div>\r\n\r\n<p class=MsoNormal style=\'mso-margin-top-alt:auto;mso-margin-bottom-alt:auto\'><span\r\nstyle=\'font-size:11.5pt;font-family:\"Verdana\",\"sans-serif\";mso-fareast-font-family:\r\n\"Times New Roman\";mso-bidi-font-family:Tahoma;color:black\'>Pakistan became a\r\nsovereign state in 1947 and its present projected population is estimated at\r\n151 million, spreads over an area of 852392 sq km. The population growth rate\r\nis 2.5 % life expectancy is about 63 yrs and the average literacy rate is 50 %.\r\nPer capita income is US $ 492. Health expenditure (public sector) is 0.08 %\r\nwhile total health sector investment is 3.9 % of GDP.<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal style=\'mso-margin-top-alt:auto;mso-margin-bottom-alt:auto\'><span\r\nstyle=\'font-size:11.5pt;font-family:\"Verdana\",\"sans-serif\";mso-fareast-font-family:\r\n\"Times New Roman\";mso-bidi-font-family:Tahoma;color:black\'>Administratively\r\nPakistan comprises of four provinces besides some Federally Administered Areas\r\nand the state of Azad Jammu and Kashmir. The country has a mixed society, which\r\nis predominantly Muslims. Urdu is the National language while multiple regional\r\nlanguages are spoken in the country; however, English is used for most official\r\npurposes. Each province/area is divided into districts, which are the basic\r\nadministrative units.<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal><span style=\'font-size:7.5pt;font-family:\"Tahoma\",\"sans-serif\";\r\nmso-fareast-font-family:\"Times New Roman\";color:black\'>&nbsp;<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal><b><span style=\'font-size:13.5pt;font-family:\"Tahoma\",\"sans-serif\";\r\nmso-fareast-font-family:\"Times New Roman\";color:black\'>Burden of TB<o:p></o:p></span></b></p>\r\n\r\n<p class=MsoNormal><span style=\'font-size:7.5pt;font-family:\"Tahoma\",\"sans-serif\";\r\nmso-fareast-font-family:\"Times New Roman\";color:black\'>&nbsp;<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal><span style=\'font-size:11.5pt;font-family:\"Verdana\",\"sans-serif\";\r\nmso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Tahoma;\r\ncolor:black\'>WHO declared TB a global emergency in <span class=GramE>1993.</span>\r\nSince then efforts have been made to expand partnerships and bring all\r\nstakeholders on board in order to control this disease more effectively. The\r\neconomic conditions correlate with new cases of TB. The highest incidence is\r\nseen in those countries of Africa, Asia, and Latin America with the lowest\r\ngross national products. WHO estimates that eight million people are infected\r\nwith TB every year, out of those 95% live in developing <span class=GramE>countries.</span>\r\nAn estimated 3 million people die due to TB every year.<br>\r\nTB has been prevalent in Pakistan and unfortunately it has been one of the\r\nneglected health areas in the past. Pakistan ranks 6th amongst the countries\r\nwith a highest burden of TB in the world. Pakistan contributes about 44% of\r\ntuberculosis burden in the Eastern Mediterranean Region. According to WHO, the\r\nincidence of sputum positive TB cases in Pakistan is 80/100,000 per year and\r\nfor all types it is 177/100,000.TB is responsible for 5.1 percent of the total\r\nnational disease burden in Pakistan. The impact of TB on socio economic status\r\nis substantial.<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal align=right style=\'text-align:right\'><span style=\'font-size:\r\n7.5pt;font-family:\"Tahoma\",\"sans-serif\";mso-fareast-font-family:\"Times New Roman\";\r\ncolor:black\'><a href=\"http://ntp.gov.pk/about.htm#top\"><b><span\r\nstyle=\'font-size:10.0pt;mso-bidi-font-size:11.0pt;font-family:\"Arial\",\"sans-serif\";\r\ncolor:black\'>TOP</span></b></a><o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal><b><span style=\'font-size:13.5pt;font-family:\"Tahoma\",\"sans-serif\";\r\nmso-fareast-font-family:\"Times New Roman\";color:black\'>The Early Years<o:p></o:p></span></b></p>\r\n\r\n<p class=MsoNormal><span style=\'font-size:7.5pt;font-family:\"Tahoma\",\"sans-serif\";\r\nmso-fareast-font-family:\"Times New Roman\";color:black\'>&nbsp;<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal><span style=\'font-size:11.5pt;font-family:\"Verdana\",\"sans-serif\";\r\nmso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Tahoma;\r\ncolor:black\'>Government of Pakistan endorsed the DOTS strategy, following <span\r\nclass=GramE>WHO’s</span> declaration of TB as a global emergency in 1993, The\r\nNational TB Control <span class=SpellE>Programme</span> (NTP) Pakistan adopted\r\nDOTS (Directly Observed Treatment, Short course) strategy in 1995. The national\r\nguidelines were developed and few pilot projects were also started. However,\r\nthe program became dormant due to abolition of the Federal Directorate for\r\nTuberculosis Control in 1996. <span class=GramE>therefore</span> the progress\r\nduring the first three years (i.e. 1995 – 1998) remained slow, because of its\r\nvertical approach, lack of consensus between federal and provincial units, and\r\nnon-availability of funds from regular health budget. In 1998 the roles and\r\nrelationship between the federal and provincial tuberculosis control program were\r\nre-defined and agreed.<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal><span style=\'font-size:7.5pt;font-family:\"Tahoma\",\"sans-serif\";\r\nmso-fareast-font-family:\"Times New Roman\";color:black\'>&nbsp;<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal><b><span style=\'font-size:13.5pt;font-family:\"Tahoma\",\"sans-serif\";\r\nmso-fareast-font-family:\"Times New Roman\";color:black\'>ROLE OF NTP IN EARTH\r\nQUAKE AFFECTED AREAS<o:p></o:p></span></b></p>\r\n\r\n<p class=MsoNormal><span style=\'font-size:7.5pt;font-family:\"Tahoma\",\"sans-serif\";\r\nmso-fareast-font-family:\"Times New Roman\";color:black\'>&nbsp;<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal style=\'mso-margin-top-alt:auto;mso-margin-bottom-alt:auto\'><span\r\nstyle=\'font-size:11.5pt;font-family:\"Verdana\",\"sans-serif\";mso-fareast-font-family:\r\n\"Times New Roman\";mso-bidi-font-family:Tahoma;color:black\'>National TB Control\r\nProgram after the devastation created by Earthquake deputed officers for\r\nestablishing coordination mechanism for services and logistics among <span\r\nclass=SpellE><span class=GramE>MoH</span></span><span class=GramE> ,</span> NGOs,\r\nArmy and District authorities and provided administrative and Technical support\r\nto DHQ <span class=SpellE>Bagh</span> and functionalized AIMS Hospital <span\r\nclass=SpellE>Muzaffarabad</span> in coordination with <span class=SpellE>MoH</span>.\r\nNTP also provided, tents bedding, transport, medicines and food to TB staff and\r\ngeneral public.<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal style=\'mso-margin-top-alt:auto;mso-margin-bottom-alt:auto\'><span\r\nstyle=\'font-size:11.5pt;font-family:\"Verdana\",\"sans-serif\";mso-fareast-font-family:\r\n\"Times New Roman\";mso-bidi-font-family:Tahoma;color:black\'>A survey was\r\nconducted by the National TB Control <span class=SpellE>Programme</span>\r\nOfficers (NPOs) in collaboration with WHO, to assess the status of the PHC\r\nnetwork in the earthquake-affected areas two weeks after the earthquake. The\r\nobjectives of the survey were:<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal style=\'mso-margin-top-alt:auto;mso-margin-bottom-alt:auto\'><span\r\nstyle=\'font-size:11.5pt;font-family:\"Verdana\",\"sans-serif\";mso-fareast-font-family:\r\n\"Times New Roman\";mso-bidi-font-family:Tahoma;color:black\'>1. To assess the\r\nstatus of the PHC network in the earthquake-affected areas, including TB DOTS\r\nservices<br>\r\n2. To set up a plan of action to restore the PHC network in the districts\r\naffected by the earthquake, and<br>\r\n3. Assess the presence of relief NGOs providing health care in the field in\r\nterms of identification, type of services provided and quantification of\r\npopulation covered by their services<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal style=\'mso-margin-top-alt:auto;mso-margin-bottom-alt:auto\'><span\r\nstyle=\'font-size:11.5pt;font-family:\"Verdana\",\"sans-serif\";mso-fareast-font-family:\r\n\"Times New Roman\";mso-bidi-font-family:Tahoma;color:black\'>NTP provided\r\nassistance for management of ARI in the disaster areas. Cluster Survey in\r\nRawalpindi/Islamabad camps and hospitals for retrieval of TB cases was\r\nconducted and treatment provided to the retrieve patients. A separate desk in\r\nTB center, Rawalpindi has been set up to register earth quake affected, TB\r\npatients. NTP acquired additional ATT drugs for 5000 patients from GDF and has\r\nsubmitted proposal to (GFATM) for 200,000$ for revitalization.<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal align=right style=\'text-align:right\'><span style=\'font-size:\r\n7.5pt;font-family:\"Tahoma\",\"sans-serif\";mso-fareast-font-family:\"Times New Roman\";\r\ncolor:black\'><a href=\"http://ntp.gov.pk/about.htm#top\"><b><span\r\nstyle=\'font-size:10.0pt;mso-bidi-font-size:11.0pt;font-family:\"Arial\",\"sans-serif\";\r\ncolor:black\'>TOP</span></b></a><o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal><span style=\'font-size:11.5pt;font-family:\"Tahoma\",\"sans-serif\";\r\nmso-fareast-font-family:\"Times New Roman\";color:black\'>Health Facilities\r\nfunctionalized and supplies provided<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal><span style=\'font-size:11.5pt;font-family:\"Tahoma\",\"sans-serif\";\r\nmso-fareast-font-family:\"Times New Roman\";color:black\'>&nbsp;<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal style=\'mso-margin-top-alt:auto;mso-margin-bottom-alt:auto\'><span\r\nstyle=\'font-size:11.5pt;font-family:\"Tahoma\",\"sans-serif\";mso-fareast-font-family:\r\n\"Times New Roman\";color:black\'>AJK: 30 Health facilities functionalized 31\r\ntents and furniture, 4 generators, 15 microscopes and drugs for 4000 patients.<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal style=\'mso-margin-top-alt:auto;mso-margin-bottom-alt:auto\'><span\r\nstyle=\'font-size:11.5pt;font-family:\"Tahoma\",\"sans-serif\";mso-fareast-font-family:\r\n\"Times New Roman\";color:black\'>NWFP: 11 health facilities functionalized 37\r\ntents and furniture 4 generators, 19 Microscopes and drugs for 1500 patients.<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal><span style=\'font-size:7.5pt;font-family:\"Tahoma\",\"sans-serif\";\r\nmso-fareast-font-family:\"Times New Roman\";color:black\'>&nbsp;<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal><b><span style=\'font-size:13.5pt;mso-bidi-font-size:11.0pt;\r\nfont-family:\"Tahoma\",\"sans-serif\";mso-fareast-font-family:\"Times New Roman\";\r\ncolor:black\'>Future Plans</span></b><span style=\'font-size:7.5pt;font-family:\r\n\"Tahoma\",\"sans-serif\";mso-fareast-font-family:\"Times New Roman\";color:black\'><o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal><span style=\'font-size:7.5pt;font-family:\"Tahoma\",\"sans-serif\";\r\nmso-fareast-font-family:\"Times New Roman\";color:black\'>&nbsp;<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal style=\'mso-margin-top-alt:auto;mso-margin-bottom-alt:auto\'><span\r\nstyle=\'font-size:11.5pt;font-family:\"Verdana\",\"sans-serif\";mso-fareast-font-family:\r\n\"Times New Roman\";mso-bidi-font-family:Tahoma;color:black\'>• Rehabilitation/\r\nReconstruction of PHC/TB network<br>\r\n• Provision of prefabricated containers<br>\r\n• Field supervision visits to verify quality of services<br>\r\n• Health education campaign among the community<br>\r\n• Establish a referral system between field hospitals/ camps and PHC/TB\r\nfacilities</span><span style=\'font-size:11.5pt;mso-bidi-font-size:11.0pt;\r\nfont-family:\"Verdana\",\"sans-serif\";mso-fareast-font-family:\"Times New Roman\";\r\nmso-bidi-font-family:Tahoma;color:black\'>&nbsp;</span><span style=\'font-size:\r\n11.5pt;font-family:\"Verdana\",\"sans-serif\";mso-fareast-font-family:\"Times New Roman\";\r\nmso-bidi-font-family:Tahoma;color:black\'><br>\r\n• Default tracing mechanism<o:p></o:p></span></p>\r\n\r\n<p class=MsoNormal><o:p>&nbsp;</o:p></p>\r\n\r\n</div>', '0', '1', '1', '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('35', 'LHW', '<p align=\"center\">&nbsp; <strong>LADY HEALTH WORKERS PROGRAM</strong></p>\r\n<p align=\"left\">The Ministry of Health&rsquo;s National Program for Family Planning and Primary Health Care, commonly referred to as the Lady Health Workers (LHW) Program, was launched under the Eighth Five Year Plan in 1993, aimed at increasing access to basic preventive health care services, particularly in rural areas. Lady Health Workers (LHWs) deliver a range of services related to maternal and child health including: promoting childhood immunization, growth monitoring, family planning and health promotion. They treat minor ailments and injuries, and are trained to identify and refer serious cases. Their family planning responsibilities include motivating women to practice contraception, providing pills and condoms, and referring consenting cases for injections, IUDs and/or sterilization. They are provided with a kit that includes contraceptive pills, condoms, paracetamol syrup and tablets, eye ointment, ORS sachets for diarrhea, chloroquin for malaria and cotrimoxazole for respiratory infections. A referral form is used to refer patients requiring further care to the next level facilities</p>\r\n<p align=\"left\">&nbsp; <strong style=\"\">List of Contraceptives </strong></p>\r\n<blockquote style=\"margin-right: 0px;\" dir=\"ltr\">\r\n<p align=\"left\"><span style=\"\"><span style=\"\">1.<span style=\"font: 7pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>Male condom (generic)</p>\r\n<p align=\"left\"><span style=\"\"><span style=\"\">2.<span style=\"font: 7pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>Depot Medroxyprogesterone Acetate (DMPA)</p>\r\n<p align=\"left\"><span style=\"\"><span style=\"\">3.<span style=\"font: 7pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>Combined Oral Contraceptive (COC)</p>\r\n</blockquote>', '2', '1', '1', '', '', '1', 'lhw_pk_punjab.jpg', null);
INSERT INTO `tbl_cms` VALUES ('38', 'FAQs Box', '<img alt=\\\"\\\" src=\\\"plmis_src/operations/img/red_bullet.gif\\\" />Are you ensuring reproductive health product availability<br />\r\n<br />\r\n<img alt=\\\"\\\" src=\\\"plmis_src/operations/img/red_bullet.gif\\\" />Are you invested in improving contraceptive supply management?<br />\r\n<br />\r\n<img alt=\\\"\\\" src=\\\"plmis_src/operations/img/red_bullet.gif\\\" />Are you interested in seeing a national picture of inbound supplies?<br />\r\n<br />\r\n<img alt=\\\"\\\" src=\\\"plmis_src/operations/img/red_bullet.gif\\\" />Are you ensuring reproductive health product availability<br />\r\n<br />\r\n<img alt=\\\"\\\" src=\\\"plmis_src/operations/img/red_bullet.gif\\\" />Are you invested in improving contraceptive supply management?<br />\r\n<br />\r\n<img alt=\\\"\\\" src=\\\"plmis_src/operations/img/red_bullet.gif\\\" />Are you interested in seeing a national picture of inbound supplies?<br />\r\n<br />', '0', '0', null, '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('39', 'Contactus Box', 'Are you invested in improving contraceptive supply management?<br />\r\n<br />\r\n<img alt=\\\"\\\" src=\\\"plmis_src/operations/img/red_bullet.gif\\\" />Are you interested in seeing a national picture of inbound supplies?<br />\r\n<br />\r\n<img alt=\\\"\\\" src=\\\"plmis_src/operations/img/red_bullet.gif\\\" />Are you ensuring reproductive health product availability<br />\r\n<br />\r\n<img alt=\\\"\\\" src=\\\"plmis_src/operations/img/red_bullet.gif\\\" />Are you invested in improving contraceptive supply management?<br />\r\n<br />\r\n<img alt=\\\"\\\" src=\\\"plmis_src/operations/img/red_bullet.gif\\\" />Are you interested in seeing a national picture of inbound supplies?', '0', '0', null, '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('41', 'DOH Punjab', '&nbsp;\r\n<p class=\"MsoNormal\"><strong style=\"\">Introduction <o:p></o:p></strong></p>\r\n<p class=\"MsoNormal\"><strong style=\"\">Mission statement <o:p></o:p></strong></p>\r\n<p class=\"MsoNormal\">To improve the quality and coverage of Health Services with special focus on Primary Health Care to achieve Millennium Development Goals.</p>\r\n<p class=\"MsoNormal\"><strong style=\"\">Functions <o:p></o:p></strong></p>\r\n<p class=\"MsoNormal\"><strong>Preventive and Promotive Services<o:p></o:p></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">EPI</span><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">TB DOTS Program</span><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Diarrhea Diseases Control Program</span><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Malaria Control Program</span><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">National AIDS and Hepatitis Control Program</span><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 1in;\"><span style=\"font-family: \'Courier New\';\"><span style=\"\">o<span style=\"font: 7pt \'Times New Roman\';\">&nbsp;&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Drug Abuse Control; </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 1in;\"><span style=\"font-family: \'Courier New\';\"><span style=\"\">o<span style=\"font: 7pt \'Times New Roman\';\">&nbsp;&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Maternity and child welfare including family planning; </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 1in;\"><span style=\"font-family: \'Courier New\';\"><span style=\"\">o<span style=\"font: 7pt \'Times New Roman\';\">&nbsp;&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Health Education;</span></p>\r\n<p class=\"MsoNormal\"><strong>Curative Services</strong></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings; font-size: 10pt;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Management of mega Hospitals under provincial set up. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings; font-size: 10pt;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Management of Hospitals, Rural Health Centres, Basic Health Units and Dispensaries through devolved set up in the districts. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings; font-size: 10pt;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Treatment of Communicable and non-Communicable diseases. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings; font-size: 10pt;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Provision of essential drugs.</span></p>\r\n<p class=\"MsoNormal\"><strong>Human Resource Development</strong> </p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings; font-size: 10pt;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Medical education (Undergraduate and Postgraduate</span>) </p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings; font-size: 10pt;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Training of nurses </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings; font-size: 10pt;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Training of Paramedics </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings; font-size: 10pt;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">In-service training of health staff</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"\"><strong>Miscellaneous<o:p></o:p></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings; font-size: 10pt;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Planning and financing of health services; </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings; font-size: 10pt;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Undertake revision and implementation of Health Policy and initiatives at provincial level.</span><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings; font-size: 10pt;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Regular control of medicine, drugs, poisons, and dangerous drugs; </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings; font-size: 10pt;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Medico-legal examination of the injured and deceased; </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings; font-size: 10pt;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Service matters except those entrusted to Punjab Public Service Commission and S&amp;GAD; </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings; font-size: 10pt;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Medical social projects; </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings; font-size: 10pt;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Regulate Purchase, storage and supply of medicines and equipment through autonomous/devolved set ups </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings; font-size: 10pt;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Special institutions like Chemical Examiner; Drug Testing Laboratory; Public Analyst; Bacteriologist; Blood Transfusion Services; and Serologist; </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings; font-size: 10pt;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Collection, compilation, registration, and analysis of vital health statistics.</span><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -0.25in; margin-left: 0.5in;\"><span style=\"font-family: Wingdings; font-size: 10pt;\"><span style=\"\">&sect;<span style=\"font: 7pt \'Times New Roman\';\">&nbsp; </span></span></span><span lang=\"EN-GB\" style=\"\">Health systems strengthening through Women Health project, Reproductive Health Project, and new initiatives.</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"\"><o:p>&nbsp;</o:p></span><strong style=\"\"><span lang=\"EN-GB\" style=\"\">Punjab Overview</span></strong><span lang=\"EN-GB\" style=\"\"><o:p>&nbsp;</o:p></span></p>\r\n<table cellspacing=\"0\" cellpadding=\"0\" border=\"1\" align=\"left\" class=\"MsoTableGrid\" style=\"border: medium none; border-collapse: collapse; margin-left: 6.75pt; margin-right: 6.75pt;\">\r\n    <tbody>\r\n        <tr style=\"\">\r\n            <td width=\"168\" valign=\"top\" style=\"border: 1pt solid black; padding: 0in 5.4pt; width: 126.3pt;\">\r\n            <p class=\"MsoNormal\" style=\"\">Total number of districts</p>\r\n            </td>\r\n            <td width=\"177\" valign=\"top\" style=\"border-width: 1pt 1pt 1pt medium; border-style: solid solid solid none; border-color: black black black -moz-use-text-color; padding: 0in 5.4pt; width: 133pt;\">\r\n            <p class=\"MsoNormal\" style=\"\">36</p>\r\n            </td>\r\n        </tr>\r\n        <tr style=\"\">\r\n            <td width=\"168\" valign=\"top\" style=\"border-width: medium 1pt 1pt; border-style: none solid solid; border-color: -moz-use-text-color black black; padding: 0in 5.4pt; width: 126.3pt;\">\r\n            <p class=\"MsoNormal\" style=\"\">Population</p>\r\n            </td>\r\n            <td width=\"177\" valign=\"top\" style=\"border-width: medium 1pt 1pt medium; border-style: none solid solid none; border-color: -moz-use-text-color black black -moz-use-text-color; padding: 0in 5.4pt; width: 133pt;\">\r\n            <p class=\"MsoNormal\" style=\"\">73.6 million (1998 census)</p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Punjab Map</strong></p>\r\n<p><img height=\"429\" width=\"400\" src=\"plmis_src/operations/img/Punjab_districts_Pakistan.png\" alt=\"\" style=\"width: 504px; height: 466px;\" /></p>\r\n<p><v:shapetype coordsize=\"21600,21600\" o:spt=\"202\" path=\"m,l,21600r21600,l21600,xe\" id=\"_x0000_t202\"><v:shapetype coordsize=\"21600,21600\" o:spt=\"202\" path=\"m,l,21600r21600,l21600,xe\" id=\"_x0000_t202\">&nbsp;<v:stroke joinstyle=\"miter\"></v:stroke><v:path gradientshapeok=\"t\" o:connecttype=\"rect\"></v:path></v:shapetype><v:shape type=\"#_x0000_t202\" id=\"_x0000_s1027\" style=\"z-index: 251658240; position: absolute; margin-top: 421.4pt; width: 454.7pt; height: 101.45pt; margin-left: 55.1pt;\"><v:textbox>&nbsp;</v:textbox></v:shape>&nbsp;<v:stroke joinstyle=\"miter\"></v:stroke><v:path gradientshapeok=\"t\" o:connecttype=\"rect\"></v:path></v:shapetype><v:shape type=\"#_x0000_t202\" id=\"_x0000_s1026\" style=\"z-index: 251658240; position: absolute; margin-top: 421.4pt; width: 454.7pt; height: 101.45pt; margin-left: 55.1pt;\"><v:textbox>&nbsp;</v:textbox></v:shape><v:shapetype coordsize=\"21600,21600\" o:spt=\"202\" path=\"m,l,21600r21600,l21600,xe\" id=\"_x0000_t202\">&nbsp;<v:stroke joinstyle=\"miter\"></v:stroke><v:path gradientshapeok=\"t\" o:connecttype=\"rect\"></v:path></v:shapetype><v:shape type=\"#_x0000_t202\" id=\"_x0000_s1026\" style=\"z-index: 251658240; position: absolute; margin-top: 421.4pt; width: 454.7pt; height: 101.45pt; margin-left: 55.1pt;\"><v:textbox>&nbsp;</v:textbox></v:shape><font face=\"Times New Roman\"><font size=\"3\"><v:stroke joinstyle=\"miter\"></v:stroke><v:path gradientshapeok=\"t\" o:connecttype=\"rect\"></v:path></font></font><v:shape type=\"#_x0000_t202\" id=\"_x0000_s1026\" style=\"z-index: 251658240; position: absolute; margin-top: 421.4pt; width: 454.7pt; height: 101.45pt; margin-left: 55.1pt;\"></v:shape>\r\n<table cellspacing=\"0\" cellpadding=\"0\" width=\"100%\">\r\n    <tbody>\r\n        <tr>\r\n            <td>\r\n            <div>\r\n            <p class=\"MsoNormal\">1. Attock, 2. Bhawalnagar, 3. Bhawalpur, 4. Bhakkar, 5. Chakwal, 6. Chiniot, 7. Dera Ghazi Khan, 8. Faisalabad, 9. Gujranwala, 10. Gujrat, 11. Hafizabad, 12. Jhang, 13. Jehlum, 14. Kasur, 15. Khanewal, 16. Khushab, 17. Lahore, 18. Layyah, 19. Lodhran, 20. Mandi Bahauddin, 21. Mianwali, 22. Multan, 23. Muzaffargarh, 24. Narowal, 25. Nankana Sahib, 26. Okara, 27. Pakpattan, 28. Rahimyar Khan, 29. Rajanpur, 30. Rawalpindi, 31. Sahiwal, 32. Sargodha, 33. Sheikhupura, 34. Sialkot, 35. Toba Tek Singh, 36. Vehari</p>\r\n            </div>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>\r\n', '7', '1', '1', 'Department of Health (Punjab)', '', '1', 'pak_punjab.jpg', null);
INSERT INTO `tbl_cms` VALUES ('42', 'DOH Sindh', '<h1><strong style=\"\">Sindh Health Department<o:p></o:p></strong></h1>\r\n<p class=\"MsoNoSpacing\">The Provincial Health Ministry is a standard body for providing Medical Education Training &amp; Employment</p>\r\n<p class=\"MsoNoSpacing\"><o:p></o:p><strong style=\"\">Mission statement <o:p></o:p></strong></p>\r\n<p class=\"MsoNoSpacing\">The overall vision is based on <strong>&quot;</strong><strong><span lang=\"EN-GB\" style=\"\">Health </span>for All&quot;</strong>. The new <a href=\"http://www.sindhhealth.gov.pk/n/hpolicy.doc\">Health Policy</a> aims to implement this strategy of protecting peoples against Hazardous Diseases, promoting public health, upgrading curative health facilities, enhancing equity, efficiency and effectiveness in health sector</p>\r\n<p class=\"MsoNoSpacing\"><o:p><strong style=\"\">Overview of Sindh<o:p></o:p></strong></o:p></p>\r\n<p class=\"MsoNoSpacing\">\r\n<table cellspacing=\"0\" cellpadding=\"0\" border=\"1\" style=\"border: medium none; border-collapse: collapse; margin-left: 5.4pt;\" class=\"MsoTableGrid\">\r\n    <tbody>\r\n        <tr style=\"\">\r\n            <td width=\"168\" valign=\"top\" style=\"border: 1pt solid black; padding: 0in 5.4pt; width: 126.3pt;\">\r\n            <p class=\"MsoNoSpacing\">Total number of districts</p>\r\n            </td>\r\n            <td width=\"185\" valign=\"top\" style=\"border-width: 1pt 1pt 1pt medium; border-style: solid solid solid none; border-color: black black black -moz-use-text-color; padding: 0in 5.4pt; width: 138.55pt;\">\r\n            <p class=\"MsoNoSpacing\">23</p>\r\n            </td>\r\n        </tr>\r\n        <tr style=\"\">\r\n            <td width=\"168\" valign=\"top\" style=\"border-width: medium 1pt 1pt; border-style: none solid solid; border-color: -moz-use-text-color black black; padding: 0in 5.4pt; width: 126.3pt;\">\r\n            <p class=\"MsoNoSpacing\">Total population</p>\r\n            </td>\r\n            <td width=\"185\" valign=\"top\" style=\"border-width: medium 1pt 1pt medium; border-style: none solid solid none; border-color: -moz-use-text-color black black -moz-use-text-color; padding: 0in 5.4pt; width: 138.55pt;\">\r\n            <p class=\"MsoNoSpacing\">35.47 million (1998 census)</p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>\r\n<p class=\"MsoNoSpacing\"><o:p>&nbsp;<strong>Sindh Map</strong>&nbsp; </o:p></p>\r\n<p class=\"MsoNoSpacing\"><o:p>&nbsp;<img width=\"525\" height=\"375\" src=\"plmis_img/userfiles/image/Pakistan_Sindh.png\" alt=\"\" /></o:p></p>', '7', '1', '1', '', '', '2', 'pak_sindh.jpg', null);
INSERT INTO `tbl_cms` VALUES ('43', 'DOH Balochistan', '&nbsp;\r\n<p align=\\\"center\\\" class=\\\"MsoNormal\\\"><strong style=\\\"\\\">Baluchistan Health Department<o:p></o:p></strong></p>\r\n<p class=\\\"MsoNormal\\\">Department of Health works under the Government of Baluchistan. \\\'Minister Health is In-charge. Secretary Health is Head of the Department while -DGHS is the Head of attached department - The Health Secretariat is the apex management unit for the entire health department.</p>\r\n<p class=\\\"MsoNormal\\\"><strong>Historical Background</strong><br />\r\nProvincial Health Department was established in 1971 when Baluchistan was declared as province after end of one unit. -Prior to this Baluchistan comprised of 3 regions (Quetta, Kalat &amp; Sibi). At that time, -Health Deptt. Supervised by 3 Civil Surgeons. In 1971 only six districts existed (extended to 19 districts gradually). Afterwards Province was divided into 6 Divisions (Quetta, Kalat, Makran, Sibi, Nasirabad &amp; Zhob)-Health Directors were placed at all the 6 Divisional Headquarters, being in charge of health department at divisional level. -In 2001 after devolution the Divisional Head Quarters were abolished and \\\'The District Health Management came under the District Governments. Executive District Officer Health (EDO Health) is the district manager health. At present 29 functioning districts are established in the province.</p>\r\n<p class=\\\"MsoNormal\\\">&nbsp; <strong style=\\\"\\\">Province Overview <o:p></o:p></strong></p>\r\n<p class=\\\"MsoNormal\\\">\r\n<table cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" border=\\\"1\\\" class=\\\"MsoTableGrid\\\" style=\\\"border: medium none; border-collapse: collapse; margin-left: 5.4pt;\\\">\r\n    <tbody>\r\n        <tr style=\\\"\\\">\r\n            <td valign=\\\"top\\\" width=\\\"165\\\" style=\\\"border: 1pt solid black; padding: 0in 5.4pt; width: 123.4pt;\\\">\r\n            <p class=\\\"MsoNormal\\\" style=\\\"line-height: normal; margin-bottom: 0pt;\\\"><strong style=\\\"\\\">Total number of districts<o:p></o:p></strong></p>\r\n            </td>\r\n            <td valign=\\\"top\\\" width=\\\"183\\\" style=\\\"border-width: 1pt 1pt 1pt medium; border-style: solid solid solid none; border-color: black black black -moz-use-text-color; padding: 0in 5.4pt; width: 137.35pt;\\\">\r\n            <p class=\\\"MsoNormal\\\" style=\\\"line-height: normal; margin-bottom: 0pt;\\\"><strong style=\\\"\\\">27<o:p></o:p></strong></p>\r\n            </td>\r\n        </tr>\r\n        <tr style=\\\"\\\">\r\n            <td valign=\\\"top\\\" width=\\\"165\\\" style=\\\"border-width: medium 1pt 1pt; border-style: none solid solid; border-color: -moz-use-text-color black black; padding: 0in 5.4pt; width: 123.4pt;\\\">\r\n            <p class=\\\"MsoNormal\\\" style=\\\"line-height: normal; margin-bottom: 0pt;\\\"><strong style=\\\"\\\">Total population<o:p></o:p></strong></p>\r\n            </td>\r\n            <td valign=\\\"top\\\" width=\\\"183\\\" style=\\\"border-width: medium 1pt 1pt medium; border-style: none solid solid none; border-color: -moz-use-text-color black black -moz-use-text-color; padding: 0in 5.4pt; width: 137.35pt;\\\">\r\n            <p class=\\\"MsoNormal\\\" style=\\\"line-height: normal; margin-bottom: 0pt;\\\"><strong style=\\\"\\\">6.56 million (1998 census) <o:p></o:p></strong></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>\r\n<p></p>\r\n<p><v:shapetype coordsize=\\\"21600,21600\\\" o:spt=\\\"202\\\" path=\\\"m,l,21600r21600,l21600,xe\\\" id=\\\"_x0000_t202\\\">&nbsp;<v:stroke joinstyle=\\\"miter\\\"></v:stroke><v:path gradientshapeok=\\\"t\\\" o:connecttype=\\\"rect\\\"></v:path></v:shapetype><v:shape type=\\\"#_x0000_t202\\\" id=\\\"_x0000_s1027\\\" style=\\\"z-index: 251658240; position: absolute; margin-top: 350.8pt; width: 470.3pt; height: 68.85pt; margin-left: 80.8pt;\\\"></v:shape><span style=\\\"z-index: 251658240; position: absolute; width: 619px; height: 81px;\\\">\r\n<table cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" width=\\\"100%\\\">\r\n    <tbody>\r\n        <tr>\r\n            <td>\r\n            <div v:shape=\\\"_x0000_s1027\\\" class=\\\"shape\\\" style=\\\"padding: 4.35pt 7.95pt;\\\">\r\n            <p class=\\\"MsoNormal\\\">1. Awaran 2. Barkhan 3. Bolan 4. Chagai 5. Dera Bugti 6. Gwadar 7. Jafarabad 8. Jhal Magsi 9. Kalat 10. Kech 11. Kharan 12. Kohlu 13. Khuzdar 14. Qilla Abdullah 15. Qilla Saifullah 16. Lasbela 17. Loralai 18. Mastung 19. Musakhel 20. Naseerabad 21. Nushki 22. Panjgur 23. Pishin 24. Quetta 25. Sibi<span style=\\\"\\\">&nbsp; </span>26. Zhob 27. Ziarat</p>\r\n            </div>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '7', '1', '1', 'Department of Health (Balochistan)', '', '4', 'pak_balochistan.jpg', null);
INSERT INTO `tbl_cms` VALUES ('44', 'DOH Khyber Pakhtunkhwa', '&nbsp;\r\n<p style=\"line-height: 14.4pt;\"><strong><span style=\"font-family: \'Tahoma\',\'sans-serif\'; color: black; font-size: 9pt;\">Khyber Pakhtunkhwa<o:p></o:p></span></strong></p>\r\n<p style=\"line-height: 14.4pt;\"><strong><span style=\"font-family: \'Tahoma\',\'sans-serif\'; color: black; font-size: 9pt;\">Introduction <o:p></o:p></span></strong></p>\r\n<p style=\"line-height: 14.4pt;\"><strong><span style=\"font-family: \'Tahoma\',\'sans-serif\'; color: black; font-size: 9pt;\">Mission Statement</span></strong><span style=\"font-family: \'Trebuchet MS\',\'sans-serif\'; color: rgb(204, 204, 153); font-size: 9pt;\"><br />\r\n</span><span class=\"style61\"><span style=\"font-size: 9.5pt;\">The mission of the Department of Health Government of Khyber Pakhtunkhwa is to protect the Health of all citizens in </span></span><span class=\"style61\"><span style=\"font-size: 9.5pt;\">Khyber Pakhtunkhwa</span></span><span class=\"style61\"><span style=\"font-size: 9.5pt;\">.</span></span><span style=\"font-family: \'Trebuchet MS\',\'sans-serif\'; color: rgb(204, 204, 153); font-size: 9pt;\"><o:p></o:p></span></p>\r\n<p style=\"text-align: justify; line-height: 14.4pt;\" class=\"style4\"><strong><span style=\"font-family: \'Tahoma\',\'sans-serif\'; font-size: 9.5pt;\">Vision Statement</span></strong><span style=\"font-size: 9pt;\"><o:p></o:p></span></p>\r\n<p style=\"text-align: justify; line-height: 14.4pt;\" class=\"style4\"><span class=\"style71\"><span style=\"font-size: 9.5pt;\">The Department of Health will reorganize the Health Sector in </span></span><span class=\"style61\"><span style=\"font-size: 9.5pt;\">Khyber Pakhtunkhwa</span></span><span class=\"style71\"><span style=\"font-size: 9.5pt;\"> with clear distinction between regulation, financing and provision of health services in order to achieve the optimum benefit within the available resources for the people of </span></span><span class=\"style61\"><span style=\"font-size: 9.5pt;\">Khyber Pakhtunkhwa</span></span><span class=\"style71\"><span style=\"font-size: 9.5pt;\">. The government&rsquo;s role as a guardian for the health of the citizens of </span></span><span class=\"style71\"><span style=\"font-size: 9.5pt;\"></span></span><span class=\"style61\"><span style=\"font-size: 9.5pt;\">Khyber Pakhtunkhwa</span></span><span class=\"style71\"><span style=\"font-size: 9.5pt;\"> is to regulate according to international standards the quality of health care services and health care providers and <o:p></o:p></span></span></p>\r\n<p style=\"text-align: justify; line-height: 14.4pt;\" class=\"style4\"><span class=\"style71\"><strong style=\"\"><span style=\"font-size: 9.5pt;\">Province Overview</span></strong></span><strong style=\"\"><o:p></o:p></strong></p>\r\n<table cellspacing=\"0\" cellpadding=\"0\" border=\"1\" style=\"border: medium none; border-collapse: collapse; margin-left: 5.4pt;\" class=\"MsoTableGrid\">\r\n    <tbody>\r\n        <tr style=\"\">\r\n            <td width=\"172\" valign=\"top\" style=\"border: 1pt solid black; padding: 0in 5.4pt; width: 128.8pt;\">\r\n            <p style=\"line-height: normal; margin-bottom: 0pt;\" class=\"MsoNormal\"><strong style=\"\">Total number of districts<o:p></o:p></strong></p>\r\n            </td>\r\n            <td width=\"198\" valign=\"top\" style=\"border-width: 1pt 1pt 1pt medium; border-style: solid solid solid none; border-color: black black black -moz-use-text-color; padding: 0in 5.4pt; width: 148.5pt;\">\r\n            <p style=\"line-height: normal; margin-bottom: 0pt;\" class=\"MsoNormal\"><strong style=\"\">24<o:p></o:p></strong></p>\r\n            </td>\r\n        </tr>\r\n        <tr style=\"\">\r\n            <td width=\"172\" valign=\"top\" style=\"border-width: medium 1pt 1pt; border-style: none solid solid; border-color: -moz-use-text-color black black; padding: 0in 5.4pt; width: 128.8pt;\">\r\n            <p style=\"line-height: normal; margin-bottom: 0pt;\" class=\"MsoNormal\"><strong style=\"\">Total population <o:p></o:p></strong></p>\r\n            </td>\r\n            <td width=\"198\" valign=\"top\" style=\"border-width: medium 1pt 1pt medium; border-style: none solid solid none; border-color: -moz-use-text-color black black -moz-use-text-color; padding: 0in 5.4pt; width: 148.5pt;\">\r\n            <p style=\"line-height: normal; margin-bottom: 0pt;\" class=\"MsoNormal\"><strong style=\"\">17.76 million (1998 census)<o:p></o:p></strong></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p><img alt=\"\" src=\"plmis_src/operations/img/NWFP_Districts1.PNG\" /></p>\r\n<p><v:shapetype id=\"_x0000_t202\" path=\"m,l,21600r21600,l21600,xe\" o:spt=\"202\" coordsize=\"21600,21600\">&nbsp;<v:stroke joinstyle=\"miter\"></v:stroke><v:path o:connecttype=\"rect\" gradientshapeok=\"t\"></v:path></v:shapetype><v:shape style=\"z-index: 251658240; position: absolute; margin-top: 471.55pt; width: 460.3pt; height: 65pt; margin-left: 0px;\" id=\"_x0000_s1026\" type=\"#_x0000_t202\"></v:shape><span style=\"z-index: 251658240; position: absolute; width: 615px; height: 78px;\">\r\n<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n    <tbody>\r\n        <tr>\r\n            <td>\r\n            <div style=\"padding: 4.35pt 7.95pt;\" class=\"shape\" v:shape=\"_x0000_s1026\">\r\n            <p class=\"MsoNormal\">1. Abbotabad, 2. Bannu, 3. Battagram, 4. Buner, 5. Charsadda, 6. Chitral, 7. Dera Ismail Khan, 8. Hangu, 9. Haripur, 10. Karak, 11. Kohat, 12. Kohistan, 13. Lakki Marwat, 14. Lower Dir, 15. Malakand, 16. Mansehra, 17. Mardan, 18. Nowshehra, 19. Peshawar, 20. Shangla, 21. Swabi, 22. Swat, 23. Tank, 24. Upper Dir</p>\r\n            </div>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</span></p>\r\n<p>&nbsp;</p>', '7', '1', '1', 'Department of Health (KPK)', '', '3', 'pak_kpk.jpg', null);
INSERT INTO `tbl_cms` VALUES ('45', 'DOH AJK', '&nbsp;\r\n<p style=\\\"background: none repeat scroll 0% 0% white;\\\"><strong style=\\\"\\\"><span lang=\\\"EN-GB\\\" style=\\\"font-family: \\\'Arial\\\',\\\'sans-serif\\\'; color: black; font-size: 11pt;\\\"><font size=\\\"2\\\">Aazad Jammu and Kashmir Health Department <o:p></o:p></font></span></strong></p>\r\n<p style=\\\"background: none repeat scroll 0% 0% white;\\\"><span lang=\\\"EN-GB\\\" style=\\\"font-family: \\\'Arial\\\',\\\'sans-serif\\\'; color: black; font-size: 11pt;\\\"><font size=\\\"2\\\">Azad Jammu and Kashmir Health department if governed by Director General Health. The Department provides preventive, curative and promotive health care services to the 3.773 million populations of Azad Jammu &amp; Kashmir through following various health facilities. <o:p></o:p></font></span></p>\r\n<p style=\\\"background: none repeat scroll 0% 0% white;\\\"><font size=\\\"2\\\"><span lang=\\\"EN-GB\\\" style=\\\"font-family: \\\'Arial\\\',\\\'sans-serif\\\'; color: black; font-size: 11pt;\\\">&nbsp;</span><strong><span lang=\\\"EN-GB\\\" style=\\\"font-family: \\\'Arial\\\',\\\'sans-serif\\\'; font-size: 11pt;\\\">Vision</span></strong></font><span lang=\\\"EN-GB\\\" style=\\\"font-family: \\\'Arial\\\',\\\'sans-serif\\\'; font-size: 11pt;\\\"><br />\r\n<font size=\\\"2\\\">To improve the health status and quality of life of entire population of AJ&amp;K by providing universal coverage of quality health care through curative, preventive and promotive health services.<o:p></o:p></font></span></p>\r\n<p style=\\\"background: none repeat scroll 0% 0% white;\\\"><font size=\\\"2\\\"><span lang=\\\"EN-GB\\\" style=\\\"font-family: \\\'Arial\\\',\\\'sans-serif\\\'; font-size: 11pt;\\\">&nbsp;</span><strong><span lang=\\\"EN-GB\\\" style=\\\"font-family: \\\'Arial\\\',\\\'sans-serif\\\'; font-size: 11pt;\\\">Goal</span></strong></font><span lang=\\\"EN-GB\\\" style=\\\"font-family: \\\'Arial\\\',\\\'sans-serif\\\'; font-size: 11pt;\\\"><br />\r\n<font size=\\\"2\\\">A healthy<span style=\\\"color: black;\\\"> state in which all citizen benefit from a better working health care delivery system, particularly the poorest.</span></font></span></p>\r\n<p style=\\\"background: none repeat scroll 0% 0% white;\\\"><span lang=\\\"EN-GB\\\" style=\\\"font-family: \\\'Arial\\\',\\\'sans-serif\\\'; font-size: 11pt;\\\"><font size=\\\"2\\\"><span style=\\\"color: black;\\\"><strong>AJK Overview</strong></span></font></span><span lang=\\\"EN-GB\\\" style=\\\"font-family: \\\'Arial\\\',\\\'sans-serif\\\'; font-size: 11pt;\\\"><font size=\\\"2\\\"><span style=\\\"color: black;\\\"><strong><o:p>&nbsp;</o:p></strong></span></font></span><span lang=\\\"EN-GB\\\" style=\\\"font-family: \\\'Arial\\\',\\\'sans-serif\\\'; font-size: 11pt;\\\"><font size=\\\"2\\\"><span style=\\\"color: black;\\\"><strong><o:p>&nbsp; </o:p></strong>\r\n<table cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" border=\\\"1\\\" class=\\\"MsoTableGrid\\\" style=\\\"border: medium none; border-collapse: collapse; margin-left: 5.4pt;\\\">\r\n    <tbody>\r\n        <tr style=\\\"\\\">\r\n            <td valign=\\\"top\\\" width=\\\"172\\\" style=\\\"border: 1pt solid black; padding: 0in 5.4pt; width: 128.8pt;\\\">\r\n            <p class=\\\"MsoNormal\\\" style=\\\"line-height: normal; margin-bottom: 0pt;\\\"><strong style=\\\"\\\">Total number of districts<o:p></o:p></strong></p>\r\n            </td>\r\n            <td valign=\\\"top\\\" width=\\\"180\\\" style=\\\"border-width: 1pt 1pt 1pt medium; border-style: solid solid solid none; border-color: black black black -moz-use-text-color; padding: 0in 5.4pt; width: 134.9pt;\\\">\r\n            <p class=\\\"MsoNormal\\\" style=\\\"line-height: normal; margin-bottom: 0pt;\\\"><strong style=\\\"\\\">10<o:p></o:p></strong></p>\r\n            </td>\r\n        </tr>\r\n        <tr style=\\\"\\\">\r\n            <td valign=\\\"top\\\" width=\\\"172\\\" style=\\\"border-width: medium 1pt 1pt; border-style: none solid solid; border-color: -moz-use-text-color black black; padding: 0in 5.4pt; width: 128.8pt;\\\">\r\n            <p class=\\\"MsoNormal\\\" style=\\\"line-height: normal; margin-bottom: 0pt;\\\"><strong style=\\\"\\\">Total population<o:p></o:p></strong></p>\r\n            </td>\r\n            <td valign=\\\"top\\\" width=\\\"180\\\" style=\\\"border-width: medium 1pt 1pt medium; border-style: none solid solid none; border-color: -moz-use-text-color black black -moz-use-text-color; padding: 0in 5.4pt; width: 134.9pt;\\\">\r\n            <p class=\\\"MsoNormal\\\" style=\\\"line-height: normal; margin-bottom: 0pt;\\\"><strong style=\\\"\\\">2.97 million (1998 census)<o:p></o:p></strong></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<strong></strong></span></font></span></p>\r\n<p style=\\\"background: none repeat scroll 0% 0% white;\\\">AJK Map</p>\r\n<p style=\\\"background: none repeat scroll 0% 0% white;\\\"><img height=\\\"429\\\" width=\\\"400\\\" src=\\\"plmis_src/operations/img/2000px-Muzaffarabad_Azad_Kashmir_svg.png\\\" alt=\\\"\\\" /></p>', '7', '1', '1', 'Department of Health (AJK)', '', '5', 'pak_kashmir.jpg', null);
INSERT INTO `tbl_cms` VALUES ('46', 'DOH Islamabad', '<p style=\"MARGIN: 0in 0in 10pt\" class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal\"><span style=\"LINE-HEIGHT: 115%; FONT-SIZE: 14pt\"><font face=\"Calibri\">Islamabad Capital Territory<o:p></o:p></font></span></strong></p>\r\n<p style=\"MARGIN: 0in 0in 10pt\" class=\"MsoNormal\"><strong><font size=\"3\" face=\"Calibri\">District Health Department</font></strong></p>\r\n<p style=\"MARGIN: 0in 0in 10pt\" class=\"MsoNormal\"><font size=\"3\" face=\"Calibri\">Health Department of the Deputy Commissioner\'s Office is responsible for maintaining health in the rural areas of Islamabad Capital Territory (ICT). There are twelve (14) Basic Health Units (BHU), three (3) Rural Health Centers (RHC) and two (2) Laboratories (Labs) working under the Health Department. There is a Main Drug Store which is located in the vicinity of District Health Officer\'s (DHO) office of the Health Department, an attached department of the Deputy Commissioner\'s Office.</font></p>\r\n<p style=\"MARGIN: 0in 0in 10pt\" class=\"MsoNormal\"><strong><font size=\"3\" face=\"Calibri\">Relevant laws/rules notifications:</font></strong></p>\r\n<ul style=\"MARGIN-TOP: 0in\" type=\"disc\">\r\n    <li style=\"MARGIN: 0in 0in 10pt; mso-list: l0 level1 lfo1; tab-stops: list .5in\" class=\"MsoNormal\"><font size=\"3\"><font face=\"Calibri\">Drugs Act, 1976 and ICT Drugs rules 1989 made there under to ensure the sale of quality assured medicines in urban/rural Islamabad <o:p></o:p></font></font></li>\r\n    <li style=\"MARGIN: 0in 0in 10pt; mso-list: l0 level1 lfo1; tab-stops: list .5in\" class=\"MsoNormal\"><font size=\"3\"><font face=\"Calibri\">PMDC Ordinance (Amendment) 1999 to prevent illegal medical practice in urban/rural Islamabad. <o:p></o:p></font></font></li>\r\n</ul>\r\n<p style=\"TEXT-INDENT: -0.25in; MARGIN: 0in 0in 10pt 0.5in; mso-list: l0 level1 lfo1; tab-stops: list .5in\" class=\"MsoListParagraph\"><span style=\"LINE-HEIGHT: 115%; FONT-FAMILY: Symbol; FONT-SIZE: 10pt; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; mso-bidi-font-size: 11.0pt\"><span style=\"mso-list: Ignore\">&middot;<span style=\"FONT: 7pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><font size=\"3\" face=\"Calibri\">Pure Food Ordinance 1960 and PPC-269 &amp; 273 Hygiene &amp; Sanitation Rules for the purpose of food safety in urban/rural Islamabad. </font></p>', '0', '0', '0', '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('47', 'GS', '<p class=\"MsoNormal\"><b>Introduction: </b>\r\n<p class=\"MsoNormal\">Greenstar Social Marketing Pakistan (Guarantee) Limited is a nonprofit, non-governmental organization devoted to improving quality of life among low-income people. \r\n<p class=\"MsoNormal\">A non-governmental organization, Greenstar works through the private sector and with the Government of Pakistan, empowering healthier choices and improving access to affordable, high-quality health products and services.<br />\r\n<br />\r\nFollowing the Government of Pakistan, Greenstar is the country&rsquo;s second-largest family planning provider. Having achieved significant progress in building the country&rsquo;s network of private &ldquo;trustworthy family planning service providers,&rdquo; in 2005 Greenstar launched a broader network of private &ldquo;family healthcare providers&rdquo; under the name &ldquo;GoodLife.&rdquo;<br />\r\n<br />\r\nGreenstar&rsquo;s Sabz Sitara portfolio has become synonymous with high quality, affordable family planning in Pakistan. The GoodLife portfolio addresses a broader spectrum of family health needs &ndash; including maternal and child health issues such as safe water, nutrition and malaria, and infectious diseases such as HIV and TB. </p>\r\n<p class=\"MsoNormal\"><br />\r\n<strong>Mission</strong><br />\r\n<span style=\"\">To improve the quality of life among people throughout Pakistan by increasing access to and use of health products, services and information, particularly in the lower socio-economic population groups.</span></p>', '5', '1', '1', 'Greenstar Social Marketing Pakistan (Guarantee) Limited ', '', '8', 'pak_federal.jpg', null);
