ocked=\"false\" Priority=\"19\" SemiHidden=\"false\"\r\nUnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Emphasis\" />\r\n<w:LsdException Locked=\"false\" Priority=\"21\" SemiHidden=\"false\"\r\nUnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Emphasis\" />\r\n<w:LsdException Locked=\"false\" Priority=\"31\" SemiHidden=\"false\"\r\nUnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Reference\" />\r\n<w:LsdException Locked=\"false\" Priority=\"32\" SemiHidden=\"false\"\r\nUnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Reference\" />\r\n<w:LsdException Locked=\"false\" Priority=\"33\" SemiHidden=\"false\"\r\nUnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Book Title\" />\r\n<w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\" />\r\n<w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\" />\r\n</w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n/* Style Definitions */\r\ntable.MsoNormalTable\r\n{mso-style-name:\"Table Normal\";\r\nmso-tstyle-rowband-size:0;\r\nmso-tstyle-colband-size:0;\r\nmso-style-noshow:yes;\r\nmso-style-priority:99;\r\nmso-style-qformat:yes;\r\nmso-style-parent:\"\";\r\nmso-padding-alt:0in 5.4pt 0in 5.4pt;\r\nmso-para-margin-top:0in;\r\nmso-para-margin-right:0in;\r\nmso-para-margin-bottom:10.0pt;\r\nmso-para-margin-left:0in;\r\nline-height:115%;\r\nmso-pagination:widow-orphan;\r\nfont-size:11.0pt;\r\nfont-family:\"Calibri\",\"sans-serif\";\r\nmso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;\r\nmso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;}\r\n</style>\r\n<![endif]-->\r\n<table width=\"77%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" class=\"MsoNormalTable\" style=\"width: 77%;\">\r\n    <tbody>\r\n        <tr style=\"\">\r\n            <td style=\"padding: 0in;\">\r\n            <p class=\"MsoNormal\">Rahnuma started serving poor and marginalized people of   Pakistan as the Family Planning Association of Pakistan (FPAP) way back in   1953, as one of the pioneers in providing family planning services and   advocating for the small family norm. The government later embraced the cause   by establishing the Ministry of Population Welfare in 196-. In about a   decade, Rahnuma -FPAP had grown up from one-room operation at Karachi, Lahore   and Dhaka to an infrastructure of district branches with model clinics and   information centers extending the message to men and women. It expanded its   work through community based infrastructure by establishing the family   welfare centers in peri-urban and rural areas. Now the organization has the   biggest infrastructure by an NGO in Pakistan, which consists of the Family   Welfare Centers, Family Health Hospitals, Focus Area Programs and a wide   network of referrals from the private practitioners. Rahnuma - FPAP has also   pioneered in the concepts of social marketing of contraceptives, family welfare   centers and reproductive health services.<br />\r\n            Rahnuma has been working on various innovative programs to increased access   of people to quality and affordable health services, advocate for a   right-based agenda, empowering the communities, especially the women and   young girls, and strengthen the civil society in Pakistan. To meet these   ends, the organization widened its scope to cover sexual and reproductive   health of the whole family as an offshoot of organizational concern for the   total well being of women, children, families and communities, after the   1994&rsquo;s International Conference on Population and Development, in Cairo.   Rahnuma is also working on its poverty alleviation program, as the health and   wellbeing of people is directly linked with the socio-economic conditions. <br />\r\n            As the organization has celebrated over fifty years of momentous achievements   and encouraging history, its name did not reflect the scope of its work. So   FPAP renamed itself to &lsquo;Rahnuma&rsquo;, which means a guide for development and   prosperity. The change in name and logo was an outcome of a management   review, in which a comprehensive analysis of management and human resource   was done to enhance the organizational capacity for meeting its development   agenda and serving the communities in a better way. Currently, Rahnuma is   working on its strategic framework of 5 A&rsquo;s that include: Adolescents and   catering to their needs; combating HIV/AIDS; minimizing the risk of unsafe   Abortions; increasing Access to services, particularly for the poor and the   marginalized; and Advocacy for the Rights. </p>\r\n            </td>\r\n        </tr>\r\n        <tr style=\"\">\r\n            <td style=\"padding: 0in;\">&nbsp;</td>\r\n        </tr>\r\n        <tr style=\"\">\r\n            <td style=\"padding: 0in;\">\r\n            <p class=\"MsoNormal\"><strong>Our Vision: </strong><br />\r\n            Rahnuma - FPAP to lead a right based movement using the ICPD holistic   development paradigm which strengthens family well being, enables empowerment   of women, supports youth and protects children. </p>\r\n            <p class=\"MsoNormal\"><strong>Our Mission:</strong><br />\r\n            Rahnuma - FPAP is committed to :- </p>\r\n            <p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left: 0.25in; text-indent: -0.25in;\"><span style=\"font-family: Symbol;\"><span style=\"\">&middot;<span style=\"font: 7pt &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;   </span></span></span>Promoting Family Planning and Sexual &amp;   Reproductive Health as a basic human right. </p>\r\n            <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 0.25in; text-indent: -0.25in;\"><span style=\"font-family: Symbol;\"><span style=\"\">&middot;<span style=\"font: 7pt &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;   </span></span></span>Providing sustainable and quality sexual &amp;   reproductive health and family planning services to men, women and youth in   partnership with government, NGOs and civil society. </p>\r\n            <p class=\"MsoListParagraphCxSpLast\" style=\"margin-left: 0.25in; text-indent: -0.25in;\"><span style=\"font-family: Symbol;\"><span style=\"\">&middot;<span style=\"font: 7pt &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;   </span></span></span>Improving the quality of life of the poor and   marginalized.</p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p class=\"MsoNormal\">&nbsp;</p>', '0', '1', '1', '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('49', 'MSI', '<div align=\"center\" >\r\n<img src=\"plmis_admin/images/MSS_logo.gif\" width=\"647\" height=\"152\" />\r\n</div> \r\n\r\n<div style=\"text-align:left;margin-top:10px;\">\r\n<img src=\"plmis_admin/images/MSS_Theme.jpg\" style=\"float:right;margin-right:10px;\" width=\"155\" height=\"203\" />\r\n<div style=\"width:830px;\"><p>Marie Stopes Society (MSS) is a social enterprise delivering high quality, voluntary, affordable family planning and reproductive health (FPRH) services through a rights-based approach. Registered in 1991 under the Societies Registration Act 1860, MSS is a leading partner of Marie Stopes International&apos;s global partnership. </p>\r\n\r\n<p>With a vision to &apos;Improve the reproductive health of people in Pakistan&apos;, MSS takes quality FPRH services to the underserved through its multi-tiered service model currently comprising an 82-clinic network across 73 districts; 14 mobile outreach teams; over 300 Suraj Social Franchise private providers; and a 24/7 Helpline and interactive website. MSS implements a demand side financing voucher scheme and has a cadre of over 400 local Field Health Educators that reduce barriers to FPRH information and access to quality services. </p>\r\n\r\n<p>Committed to high clinical and operational standards, MSS is the first FPRH service provider in Pakistan to have received ISO Certification. MSS works with the support and collaboration of the public sector, the communities it serves and partners. </p>\r\n</div></div>', '6', '1', '1', '', '', '1', 'pak_federal.jpg', null);
INSERT INTO `tbl_cms` VALUES ('51', 'DOH FATA', '&nbsp;\r\n<p align=\\\"center\\\" class=\\\"MsoNormal\\\"><strong style=\\\"\\\"><span style=\\\"line-height: 115%; font-family: \\\'Verdana\\\',\\\'sans-serif\\\'; color: black; font-size: 10pt;\\\">FATA Health Directorate</span></strong></p>\r\n<strong style=\\\"\\\"><span style=\\\"line-height: 115%; font-family: \\\'Verdana\\\',\\\'sans-serif\\\'; color: black; font-size: 10pt;\\\">\r\n<p class=\\\"MsoNormal\\\">&nbsp;</p>\r\n<p class=\\\"MsoNormal\\\"><strong style=\\\"\\\"><span style=\\\"line-height: 115%; font-family: \\\'Verdana\\\',\\\'sans-serif\\\'; color: black; font-size: 10pt;\\\">FATA Overview<o:p></o:p></span></strong></p>\r\n<table cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" border=\\\"1\\\" class=\\\"MsoTableGrid\\\" style=\\\"border: medium none; border-collapse: collapse; margin-left: 5.4pt;\\\">\r\n    <tbody>\r\n        <tr style=\\\"\\\">\r\n            <td valign=\\\"top\\\" width=\\\"250\\\" style=\\\"border: 1pt solid black; padding: 0in 5.4pt; width: 187.65pt;\\\">\r\n            <p class=\\\"MsoNormal\\\" style=\\\"line-height: normal; margin-bottom: 0pt;\\\"><strong style=\\\"\\\">Total number of agencies and regions<o:p></o:p></strong></p>\r\n            </td>\r\n            <td valign=\\\"top\\\" width=\\\"256\\\" style=\\\"border-width: 1pt 1pt 1pt medium; border-style: solid solid solid none; border-color: black black black -moz-use-text-color; padding: 0in 5.4pt; width: 192.15pt;\\\">\r\n            <p class=\\\"MsoNormal\\\" style=\\\"line-height: normal; margin-bottom: 0pt;\\\"><strong style=\\\"\\\">7 tribal agencies and 6 frontier regions<o:p></o:p></strong></p>\r\n            </td>\r\n        </tr>\r\n        <tr style=\\\"\\\">\r\n            <td valign=\\\"top\\\" width=\\\"250\\\" style=\\\"border-width: medium 1pt 1pt; border-style: none solid solid; border-color: -moz-use-text-color black black; padding: 0in 5.4pt; width: 187.65pt;\\\">\r\n            <p class=\\\"MsoNormal\\\" style=\\\"line-height: normal; margin-bottom: 0pt;\\\"><strong style=\\\"\\\">Total population <o:p></o:p></strong></p>\r\n            </td>\r\n            <td valign=\\\"top\\\" width=\\\"256\\\" style=\\\"border-width: medium 1pt 1pt medium; border-style: none solid solid none; border-color: -moz-use-text-color black black -moz-use-text-color; padding: 0in 5.4pt; width: 192.15pt;\\\">\r\n            <p class=\\\"MsoNormal\\\" style=\\\"line-height: normal; margin-bottom: 0pt;\\\"><strong style=\\\"\\\">3.18 million (1998 census)<o:p></o:p></strong></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p align=\\\"center\\\"><img height=\\\"268\\\" width=\\\"250\\\" src=\\\"plmis_src/operations/img/FATA_Pakistan.png\\\" alt=\\\"\\\" style=\\\"width: 489px; height: 354px;\\\" /></p>\r\n<p>&nbsp;</p>\r\n</span></strong><span style=\\\"line-height: 115%; font-family: \\\'Verdana\\\',\\\'sans-serif\\\'; color: black; font-size: 10pt;\\\">The department of health has been striving to promote a healthy society through a network of facilities and services. The Directorate of Health FATA is headed by a director who manages the health services through his representative head of department in each agency. The directorate plans, executes, operates and maintains agency/tehsil head quarter hospitals, rural health centres, basic health units, dispensaries, clinics and health centres. The health department has a major responsibility in providing basic health services to people, preventing spread of diseases, ensuring healthy and safe environment, products, eating habits and safe food, safety and security in maternal and child health and encouraging community in participation in health services.<o:p></o:p></span>', '0', '1', '1', '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('52', 'DOH Gilgit Baltistan', '&nbsp;\r\n<p align=\\\"center\\\" class=\\\"MsoNormal\\\"><strong><o:p>&nbsp;</o:p></strong><strong>Gilgit Baltistan Health and Population Welfare Department <o:p></o:p></strong></p>\r\n<p class=\\\"MsoNoSpacing\\\"><strong style=\\\"\\\">Functions <o:p></o:p></strong></p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">1.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>Prevention and Control of infectious and contagious diseases. </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">2.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>Tuberculosis. </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">3.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>Eradication/Control of Malaria. </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">4.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>Lappers Act. </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">5.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>Treatment of patients bitten by rebind animals. </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">6.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>Adulteration of foodstuffs. </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">7.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>Nutrition Survives. </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">8.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>Nutrition and publicity in regard to food. </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">9.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>Vaccination and inoculation. </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">10.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp; </span></span></span>Maternity and Child Welfare and </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">11.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp; </span></span></span>Port Quarantine. </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">12.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp; </span></span></span>Regulation of medical and other professional qualifications and standards. </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">13.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp; </span></span></span>Medical Practitioners (National Service) Act, 1950 </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">14.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp; </span></span></span>Indigenous systems of medicine. </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">15.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp; </span></span></span>Medical Attendance of Government Servants. </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">16.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp; </span></span></span>Levy of fees by Medical Officers. </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">17.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp; </span></span></span>Medical and nursing council. </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">18.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp; </span></span></span>Control on medical drugs, poisons and dangerous drugs (Drugs Act and Rules) </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">19.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp; </span></span></span>Medical institutions, chemical examination laboratories and Blood transfusion services in GB. </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">20.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp; </span></span></span>Collection, compilation, registration and analysis of vital health statistics and estimation of population for future projections. </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">21.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp; </span></span></span>Service matters except those entrusted to SGAD Department. </p>\r\n<p class=\\\"MsoNoSpacing\\\" style=\\\"text-indent: -0.25in; margin-left: 0.5in;\\\"><span style=\\\"\\\"><span style=\\\"\\\">22.<span style=\\\"font: 7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp; </span></span></span>Population planning. </p>\r\n<p class=\\\"MsoNormal\\\"><o:p>&nbsp;</o:p><strong style=\\\"\\\">Gilgit Overview<o:p></o:p></strong></p>\r\n<table cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" border=\\\"1\\\" class=\\\"MsoTableGrid\\\" style=\\\"border: medium none; border-collapse: collapse; margin-left: 5.4pt;\\\">\r\n    <tbody>\r\n        <tr style=\\\"\\\">\r\n            <td valign=\\\"top\\\" width=\\\"175\\\" style=\\\"border: 1pt solid black; padding: 0in 5.4pt; width: 131.3pt;\\\">\r\n            <p class=\\\"MsoNormal\\\" style=\\\"line-height: normal; margin-bottom: 0pt;\\\"><strong style=\\\"\\\">Total number of districts <o:p></o:p></strong></p>\r\n            </td>\r\n            <td valign=\\\"top\\\" width=\\\"157\\\" style=\\\"border-width: 1pt 1pt 1pt medium; border-style: solid solid solid none; border-color: black black black -moz-use-text-color; padding: 0in 5.4pt; width: 117.45pt;\\\">\r\n            <p class=\\\"MsoNormal\\\" style=\\\"line-height: normal; margin-bottom: 0pt;\\\"><strong style=\\\"\\\">7<o:p></o:p></strong></p>\r\n            </td>\r\n        </tr>\r\n        <tr style=\\\"\\\">\r\n            <td valign=\\\"top\\\" width=\\\"175\\\" style=\\\"border-width: medium 1pt 1pt; border-style: none solid solid; border-color: -moz-use-text-color black black; padding: 0in 5.4pt; width: 131.3pt;\\\">\r\n            <p class=\\\"MsoNormal\\\" style=\\\"line-height: normal; margin-bottom: 0pt;\\\"><strong style=\\\"\\\">Total population<o:p></o:p></strong></p>\r\n            </td>\r\n            <td valign=\\\"top\\\" width=\\\"157\\\" style=\\\"border-width: medium 1pt 1pt medium; border-style: none solid solid none; border-color: -moz-use-text-color black black -moz-use-text-color; padding: 0in 5.4pt; width: 117.45pt;\\\">\r\n            <p class=\\\"MsoNormal\\\" style=\\\"line-height: normal; margin-bottom: 0pt;\\\"><strong style=\\\"\\\">870,347 (1998 census)<o:p></o:p></strong></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p class=\\\"MsoNormal\\\"><strong style=\\\"\\\"><o:p>&nbsp;</o:p></strong></p>\r\n<p align=\\\"center\\\" class=\\\"MsoNormal\\\"><img height=\\\"214\\\" width=\\\"200\\\" src=\\\"plmis_src/operations/img/800px-Northern_Areas_Pakistan_svg.png\\\" alt=\\\"\\\" style=\\\"width: 353px; height: 324px;\\\" /></p>\r\n<p align=\\\"center\\\" class=\\\"MsoNormal\\\">&nbsp;</p>', '0', '1', '1', '', '', '0', '', null);
