INSERT INTO `tbl_cms` VALUES ('130', 'Help Data Entry', '<div>\r\n<div style=\\\"overflow: hidden; color: rgb(0, 0, 0); background-color: transparent; text-align: left; text-decoration: none; border: medium none;\\\">\r\n<li id=\\\"jsArticleStep1\\\">\r\n<div class=\\\"stepNumber\\\">1</div>\r\n<p>Read the Privacy Act and Paperwork Reduction Act Statements, located at the beginning of the 3373-BK document.</p>\r\n</li>\r\n<li id=\\\"jsArticleStep2\\\">\r\n<div class=\\\"stepNumber\\\">2</div>\r\n<p>Write the answers on a printed copy of Form 3373-BK or type the information into an electronic form (see Resources).</p>\r\n</li>\r\n<li id=\\\"jsArticleStep3\\\">\r\n<div class=\\\"stepNumber\\\">3</div>\r\n<p>Enter your name, Social Security number, contact information and where and with whom you live with into Section A.</p>\r\n</li>\r\n<li id=\\\"jsArticleStep4\\\">\r\n<div class=\\\"stepNumber\\\">4</div>\r\n<p>Describe your daily activities in Section B. Provide  information about your daily routine, the impact of your disability on  these activities, any <a href=\\\"http://www.ehow.com/parties/\\\" class=\\\"StrongLink\\\">parties</a> you care for and any assistance you receive. Check off the appropriate responses to questions about your <a href=\\\"http://www.ehow.com/fashion/\\\" class=\\\"StrongLink\\\">personal care</a>, house and yard <a href=\\\"http://www.ehow.com/careers/\\\" class=\\\"StrongLink\\\">work</a>, transportation, meals, shopping, finances, hobbies and social activities.</p>\r\n</li>\r\n<li id=\\\"jsArticleStep5\\\">\r\n<div class=\\\"stepNumber\\\">5</div>\r\n<p>Provide answers to questions about your physical and mental abilities in Section C.</p>\r\n</li>\r\n<li id=\\\"jsArticleStep6\\\">\r\n<div class=\\\"stepNumber\\\">6</div>\r\n<p>Use the &quot;Remarks&quot; section (D) at the end of the document if  you require additional space to answer a question. Include the relevant  question number next to any information provided in this section. You  also can use this section to provide any additional information you  think might be relevant and useful in evaluating your case.</p>\r\n</li>\r\n<li id=\\\"jsArticleStep7\\\">\r\n<div class=\\\"stepNumber\\\">7</div>\r\n<p>Write &quot;Don\\\'t Know,&quot; &quot;Does Not Apply&quot; or &quot;None&quot; if you are  unable to answer a question or if a question does not apply to your  case.</p>\r\n</li>\r\n<li id=\\\"jsArticleStep8\\\">\r\n<div class=\\\"stepNumber\\\">8</div>\r\n<p>Return the 3373-BK form to the office that instructed you to  complete it. Contact Social Security (see Resources) if you do not know  the address of the office that requested your 3373-BK form.</p>\r\n</li>\r\n<span><br />\r\n<br />\r\nRead more:  <a href=\\\"http://www.ehow.com/how_5539589_fill-social-security-form-bk.html#ixzz11ZSRAw2l\\\" style=\\\"color: rgb(0, 51, 153);\\\">How to Fill Out Social Security Form 3373-BK | eHow.com</a> <a href=\\\"http://www.ehow.com/how_5539589_fill-social-security-form-bk.html#ixzz11ZSRAw2l\\\" style=\\\"color: rgb(0, 51, 153);\\\">http://www.ehow.com/how_5539589_fill-social-security-form-bk.html#ixzz11ZSRAw2l</a></span></div>\r\n</div>', '0', '0', '0', '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('131', 'Annoucement', '<p><font size=\\\"1\\\" color=\\\"#ff0000\\\"><span class=\\\"Title\\\"><font color=\\\"#ff0000\\\"><img height=\\\"16\\\" width=\\\"16\\\" alt=\\\"\\\" src=\\\"/truelife/siteadmin/UserFiles/Image/info.png\\\" /> <font color=\\\"#3366ff\\\"><span style=\\\"font-weight: bold;\\\">Currently the database contains only MOPW data for January-March, 2010 for 134 districts.</span></font></font></span></font></p>', '0', '0', '0', '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('132', 'POP_CYP', '<br />\r\n<img alt=\\\"\\\" src=\\\"file:///C:/DOCUME~1/ADMINI~1/LOCALS~1/Temp/moz-screenshot.png\\\" /><img alt=\\\"\\\" src=\\\"file:///C:/DOCUME~1/ADMINI~1/LOCALS~1/Temp/moz-screenshot-1.png\\\" /><img height=\\\"308\\\" width=\\\"600\\\" src=\\\"/truelife/siteadmin/UserFiles/Image/cyp_chart.gif\\\" alt=\\\"\\\" /><br />', '0', '0', '0', '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('133', 'POP_Consumption', '<h1 class=\\\"sb1BlueRubric\\\">Consumptions</h1>\r\n<p><img height=\\\"108\\\" align=\\\"left\\\" width=\\\"58\\\" alt=\\\"\\\" src=\\\"../../plmis_img/medicine_bottle_6.gif\\\" />Average Monthly Consumption. Normally, the average number of units expected to be dispensed or distributed per month. Average monthly consumption can be calculated using the sum of quantities dispensed or distributed over a period of time, normally 12 months. You can use the monthly disbursement data from the previous page to review how disbursements were broken up during the year:</p>\r\n<p>&nbsp;</p>\r\n<p><br />\r\n</p>\r\n<table border=\\\"1\\\" width=\\\"288\\\">\r\n    <tbody>\r\n        <tr>\r\n            <th width=\\\"98\\\" scope=\\\"col\\\">Month</th>\r\n            <th width=\\\"7\\\" scope=\\\"col\\\">1</th>\r\n            <th width=\\\"7\\\" scope=\\\"col\\\">2</th>\r\n            <th width=\\\"7\\\" scope=\\\"col\\\">3</th>\r\n            <th width=\\\"7\\\" scope=\\\"col\\\">4</th>\r\n            <th width=\\\"7\\\" scope=\\\"col\\\">5</th>\r\n            <th width=\\\"7\\\" scope=\\\"col\\\">6</th>\r\n            <th width=\\\"7\\\" scope=\\\"col\\\">8</th>\r\n            <th width=\\\"7\\\" scope=\\\"col\\\">9</th>\r\n            <th width=\\\"14\\\" scope=\\\"col\\\">10</th>\r\n            <th width=\\\"14\\\" scope=\\\"col\\\">11</th>\r\n            <th width=\\\"14\\\" scope=\\\"col\\\">12</th>\r\n            <th width=\\\"10\\\" scope=\\\"col\\\">Total</th>\r\n        </tr>\r\n        <tr>\r\n            <td>\r\n            <div align=\\\"right\\\">Number Distributed</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\">2</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\">3</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\">4</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\">5</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\">5</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\">6</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\">7</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\">7</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\">8</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\">9</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\">20</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\">20</div>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>Note that in the month of August there was a stock-out and no paracetamol could be distributed<br />\r\nduring September and October. For those months you can count disbursements as &quot;X.&quot; Note<br />\r\nalso that in December there was no distribution at all, but there was stock on the shelves. For<br />\r\nthis month, count disbursements as &quot;0.&quot;</p>\r\n<p><br />\r\nFurther you must only count 10 months for the formula below, since there were 9 months when<br />\r\ndrugs were distributed, plus 1 month when there were drugs in stock but none were requested for    distribution. You should not include in the formula the months of September and October, since    stock-out of paracetamol occurred. Finally, divide the total number of paracetamol units<br />\r\nconsumed during the year by 10 (9 + 1 months).</p>\r\n<br />\r\n<!--[if gte mso 9]><xml>\r\n<w:WordDocument>\r\n<w:View>Normal</w:View>\r\n<w:Zoom>0</w:Zoom>\r\n<w:PunctuationKerning />\r\n<w:ValidateAgainstSchemas />\r\n<w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n<w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n<w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n<w:Compatibility>\r\n<w:BreakWrappedTables />\r\n<w:SnapToGridInCell />\r\n<w:WrapTextWithPunct />\r\n<w:UseAsianBreakRules />\r\n<w:DontGrowAutofit />\r\n</w:Compatibility>\r\n<w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>\r\n</w:WordDocument>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n<w:LatentStyles DefLockedState=\\\"false\\\" LatentStyleCount=\\\"156\\\">\r\n</w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n/* Style Definitions */\r\ntable.MsoNormalTable\r\n{mso-style-name:\\\"Table Normal\\\";\r\nmso-tstyle-rowband-size:0;\r\nmso-tstyle-colband-size:0;\r\nmso-style-noshow:yes;\r\nmso-style-parent:\\\"\\\";\r\nmso-padding-alt:0in 5.4pt 0in 5.4pt;\r\nmso-para-margin:0in;\r\nmso-para-margin-bottom:.0001pt;\r\nmso-pagination:widow-orphan;\r\nfont-size:10.0pt;\r\nfont-family:\\\"Times New Roman\\\";\r\nmso-ansi-language:#0400;\r\nmso-fareast-language:#0400;\r\nmso-bidi-language:#0400;}\r\ntable.MsoTableGrid\r\n{mso-style-name:\\\"Table Grid\\\";\r\nmso-tstyle-rowband-size:0;\r\nmso-tstyle-colband-size:0;\r\nborder:solid windowtext 1.0pt;\r\nmso-border-alt:solid windowtext .5pt;\r\nmso-padding-alt:0in 5.4pt 0in 5.4pt;\r\nmso-border-insideh:.5pt solid windowtext;\r\nmso-border-insidev:.5pt solid windowtext;\r\nmso-para-margin:0in;\r\nmso-para-margin-bottom:.0001pt;\r\nmso-pagination:widow-orphan;\r\nfont-size:10.0pt;\r\nfont-family:\\\"Times New Roman\\\";\r\nmso-ansi-language:#0400;\r\nmso-fareast-language:#0400;\r\nmso-bidi-language:#0400;}\r\n</style>\r\n<![endif]-->\r\n<p class=\\\"MsoNormal\\\"><strong style=\\\"\\\"><span style=\\\"font-size: 11pt; font-family: Tahoma;\\\">Calculating Consumption For Selected Product and Select Time Period</span></strong></p>\r\n<table cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" border=\\\"1\\\" width=\\\"667\\\" class=\\\"MsoTableGrid\\\" style=\\\"border: medium none ; width: 6.95in; border-collapse: collapse;\\\">\r\n    <tbody>\r\n        <tr style=\\\"\\\">\r\n            <td width=\\\"331\\\" valign=\\\"top\\\" style=\\\"border: 1pt solid windowtext; padding: 0in 5.4pt; background: rgb(153, 204, 255) none repeat scroll 0% 0%; width: 3.45in; -moz-background-clip: border; -moz-background-origin: padding; -moz-background-inline-policy: continuous;\\\">\r\n            <p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 11pt; font-family: Tahoma;\\\">Report   Type</span></p>\r\n            </td>\r\n            <td width=\\\"336\\\" valign=\\\"top\\\" style=\\\"border-style: solid solid solid none; border-color: windowtext windowtext windowtext -moz-use-text-color; border-width: 1pt 1pt 1pt medium; padding: 0in 5.4pt; background: rgb(153, 204, 255) none repeat scroll 0% 0%; width: 3.5in; -moz-background-clip: border; -moz-background-origin: padding; -moz-background-inline-policy: continuous;\\\">\r\n            <p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 11pt; font-family: Tahoma;\\\">Formula</span></p>\r\n            </td>\r\n        </tr>\r\n        <tr style=\\\"\\\">\r\n            <td width=\\\"331\\\" valign=\\\"top\\\" style=\\\"border-style: none solid solid; border-color: -moz-use-text-color windowtext windowtext; border-width: medium 1pt 1pt; padding: 0in 5.4pt; width: 3.45in;\\\">\r\n            <p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 11pt; font-family: Tahoma;\\\">National   -<span style=\\\"\\\">&nbsp; </span>Products Comparison</span></p>\r\n            <p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 11pt; font-family: Tahoma;\\\">&nbsp;</span></p>\r\n            </td>\r\n            <td width=\\\"336\\\" valign=\\\"top\\\" style=\\\"border-style: none solid solid none; border-color: -moz-use-text-color windowtext windowtext -moz-use-text-color; border-width: medium 1pt 1pt medium; padding: 0in 5.4pt; width: 3.5in;\\\">\r\n            <p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 11pt; font-family: Tahoma;\\\">Sum of   quantities issues by service delivery points to clients.<span style=\\\"\\\">&nbsp; </span>Both public and private stakeholders are   accounted. For private stakeholder like FPAS, MSI, sale data is used.</span></p>\r\n            </td>\r\n        </tr>\r\n        <tr style=\\\"\\\">\r\n            <td width=\\\"331\\\" valign=\\\"top\\\" style=\\\"border-style: none solid solid; border-color: -moz-use-text-color windowtext windowtext; border-width: medium 1pt 1pt; padding: 0in 5.4pt; width: 3.45in;\\\">\r\n            <p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 11pt; font-family: Tahoma;\\\">Stakeholder   &ndash; Selected Product,<span style=\\\"\\\">&nbsp;&nbsp; </span>Stakeholder   Comparison</span></p>\r\n            <p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 11pt; font-family: Tahoma;\\\">&nbsp;</span></p>\r\n            </td>\r\n            <td width=\\\"336\\\" valign=\\\"top\\\" style=\\\"border-style: none solid solid none; border-color: -moz-use-text-color windowtext windowtext -moz-use-text-color; border-width: medium 1pt 1pt medium; padding: 0in 5.4pt; width: 3.5in;\\\">\r\n            <p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 11pt; font-family: Tahoma;\\\">Sum of   quantities of a product issues by service delivery points to clients managed   by stakeholder.</span></p>\r\n            </td>\r\n        </tr>\r\n        <tr style=\\\"\\\">\r\n            <td width=\\\"331\\\" valign=\\\"top\\\" style=\\\"border-style: none solid solid; border-color: -moz-use-text-color windowtext windowtext; border-width: medium 1pt 1pt; padding: 0in 5.4pt; width: 3.45in;\\\">\r\n            <p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 11pt; font-family: Tahoma;\\\">Province   - Selected Product, Province Comparison </span></p>\r\n            </td>\r\n            <td width=\\\"336\\\" valign=\\\"top\\\" style=\\\"border-style: none solid solid none; border-color: -moz-use-text-color windowtext windowtext -moz-use-text-color; border-width: medium 1pt 1pt medium; padding: 0in 5.4pt; width: 3.5in;\\\">\r\n            <p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 11pt; font-family: Tahoma;\\\">Sum of   quantities of a product issues by service delivery points to clients managed   by stakeholder and<span style=\\\"\\\">&nbsp; </span>province</span></p>\r\n            </td>\r\n        </tr>\r\n        <tr style=\\\"\\\">\r\n            <td width=\\\"331\\\" valign=\\\"top\\\" style=\\\"border-style: none solid solid; border-color: -moz-use-text-color windowtext windowtext; border-width: medium 1pt 1pt; padding: 0in 5.4pt; width: 3.45in;\\\">\r\n            <p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 11pt; font-family: Tahoma;\\\">District   &ndash; Selected Stakeholder, <span style=\\\"\\\">&nbsp;</span>Selected Product,   Selected Province, District Comparison </span></p>\r\n            </td>\r\n            <td width=\\\"336\\\" valign=\\\"top\\\" style=\\\"border-style: none solid solid none; border-color: -moz-use-text-color windowtext windowtext -moz-use-text-color; border-width: medium 1pt 1pt medium; padding: 0in 5.4pt; width: 3.5in;\\\">\r\n            <p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 11pt; font-family: Tahoma;\\\">Sum of   quantities of a product issues by service delivery points to clients managed   by Stakeholder, Province and District</span></p>\r\n            </td>\r\n        </tr>\r\n        <tr style=\\\"\\\">\r\n            <td width=\\\"331\\\" valign=\\\"top\\\" style=\\\"border-style: none solid solid; border-color: -moz-use-text-color windowtext windowtext; border-width: medium 1pt 1pt; padding: 0in 5.4pt; width: 3.45in;\\\">\r\n            <p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 11pt; font-family: Tahoma;\\\">Field &ndash;   Selected Stakeholder, <span style=\\\"\\\">&nbsp;</span>Selected Product,   Selected Province, Field Comparison </span></p>\r\n            </td>\r\n            <td width=\\\"336\\\" valign=\\\"top\\\" style=\\\"border-style: none solid solid none; border-color: -moz-use-text-color windowtext windowtext -moz-use-text-color; border-width: medium 1pt 1pt medium; padding: 0in 5.4pt; width: 3.5in;\\\">\r\n            <p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 11pt; font-family: Tahoma;\\\">Sum of   quantities of a product issues by service delivery points to clients managed   by Stakeholder, Province, District and Field</span></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>', '0', '0', '0', '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('134', 'pop_drill_down_report', '<br />\r\n<!--[if !mso]>\r\n<style>\r\nv\\\\:* {behavior:url(#default#VML);}\r\no\\\\:* {behavior:url(#default#VML);}\r\nw\\\\:* {behavior:url(#default#VML);}\r\n.shape {behavior:url(#default#VML);}\r\n</style>\r\n<![endif]--><!--[if gte mso 9]><xml>\r\n<w:WordDocument>\r\n<w:View>Normal</w:View>\r\n<w:Zoom>0</w:Zoom>\r\n<w:PunctuationKerning />\r\n<w:ValidateAgainstSchemas />\r\n<w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n<w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n<w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n<w:Compatibility>\r\n<w:BreakWrappedTables />\r\n<w:SnapToGridInCell />\r\n<w:WrapTextWithPunct />\r\n<w:UseAsianBreakRules />\r\n<w:DontGrowAutofit />\r\n</w:Compatibility>\r\n<w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>\r\n</w:WordDocument>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n<w:LatentStyles DefLockedState=\\\"false\\\" LatentStyleCount=\\\"156\\\">\r\n</w:LatentStyles>\r\n</xml><![endif]--><!--[if !mso]><object\r\nclassid=\\\"clsid:38481807-CA0E-42D2-BF39-B33AF135CC4D\\\" id=ieooui></object>\r\n<style>\r\nst1\\\\:*{behavior:url(#ieooui) }\r\n</style>\r\n<![endif]--><!--[if gte mso 10]>\r\n<style>\r\n/* Style Definitions */\r\ntable.MsoNormalTable\r\n{mso-style-name:\\\"Table Normal\\\";\r\nmso-tstyle-rowband-size:0;\r\nmso-tstyle-colband-size:0;\r\nmso-style-noshow:yes;\r\nmso-style-parent:\\\"\\\";\r\nmso-padding-alt:0in 5.4pt 0in 5.4pt;\r\nmso-para-margin:0in;\r\nmso-para-margin-bottom:.0001pt;\r\nmso-pagination:widow-orphan;\r\nfont-size:10.0pt;\r\nfont-family:\\\"Times New Roman\\\";\r\nmso-ansi-language:#0400;\r\nmso-fareast-language:#0400;\r\nmso-bidi-language:#0400;}\r\n</style>\r\n<![endif]-->\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-family: Arial;\\\">Drill Down Reports</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-family: Arial;\\\">&nbsp;</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-family: Arial;\\\">Drill Down reports are triggered by clicking on a designated field of an existing report. Drill Down reports are cascading i.e. trigger report B from report A and trigger report C from report B, etc.</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-family: Arial;\\\"></span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-family: Arial;\\\">&nbsp;</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-family: Arial;\\\">Pakistan Logistics Information System generates the following drill-down report</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-family: Arial;\\\"><img height=\\\"107\\\" width=\\\"576\\\" src=\\\"file:///C:/DOCUME~1/ADMINI~1/LOCALS~1/Temp/msohtml1/01/clip_image002.jpg\\\" alt=\\\"\\\" /></span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-family: Arial;\\\">Figure1: Drill Down Reports</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-family: Arial;\\\">&nbsp;</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-family: Arial;\\\">&nbsp;</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-family: Arial;\\\">As users drills down, user is provided with parameter form to filter data to their choice.</span></p>\r\n<p class=\\\"MsoNormal\\\">&nbsp;</p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-family: Arial;\\\">Examples</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\"><img height=\\\"86\\\" width=\\\"575\\\" src=\\\"file:///C:/DOCUME~1/ADMINI~1/LOCALS~1/Temp/msohtml1/01/clip_image004.jpg\\\" alt=\\\"\\\" /></span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\">Figure 2. National Summary All Products Comparison Report </span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\">&nbsp;</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\">&nbsp;</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\"><img height=\\\"104\\\" width=\\\"576\\\" src=\\\"file:///C:/DOCUME~1/ADMINI~1/LOCALS~1/Temp/msohtml1/01/clip_image006.jpg\\\" alt=\\\"\\\" /></span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\">Figure 3. National Summary Selected Product All Stakeholder Comparison Report</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\">&nbsp;</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\">&nbsp;</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\">&nbsp;</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\"><img height=\\\"91\\\" width=\\\"576\\\" src=\\\"file:///C:/DOCUME~1/ADMINI~1/LOCALS~1/Temp/msohtml1/01/clip_image008.jpg\\\" alt=\\\"\\\" /></span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\">Figure 4. Stakeholder Selected Product All Province Comparison Report</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\">&nbsp;</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\"><img height=\\\"156\\\" width=\\\"576\\\" src=\\\"file:///C:/DOCUME~1/ADMINI~1/LOCALS~1/Temp/msohtml1/01/clip_image010.jpg\\\" alt=\\\"\\\" /></span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\">Figure 5. Stakeholder Selected Product, Selected Province, All District Comparison Report</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\">&nbsp;</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\">&nbsp;</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\">&nbsp;</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\"><img height=\\\"153\\\" width=\\\"576\\\" src=\\\"file:///C:/DOCUME~1/ADMINI~1/LOCALS~1/Temp/msohtml1/01/clip_image012.jpg\\\" alt=\\\"\\\" /></span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\">Figure 6. Selected Product Selected Province Field Comparison Report</span></p>\r\n<p class=\\\"MsoNormal\\\"><span style=\\\"font-size: 10pt; font-family: Arial;\\\">&nbsp;</span></p>', '0', '0', '0', '', '', '0', '', null);
