INSERT INTO `tbl_cms` VALUES ('138', 'pop_amc', '<link type=\\\"text/css\\\" rel=\\\"stylesheet\\\" href=\\\"../../plmis_css/nn_proj.css\\\" />\r\n<h1 class=\\\"sb1BlueRubric\\\">Average Monthly Consumptions</h1>\r\n<p><img height=\\\"108\\\" align=\\\"left\\\" width=\\\"58\\\" alt=\\\"\\\" src=\\\"../../plmis_img/medicine_bottle_6.gif\\\" /><span class=\\\"sb1SmallerFont\\\">Average Monthly Consumption. Normally, the average number of units expected to be dispensed or distributed per month. Average monthly consumption can be calculated using the sum of quantities dispensed or distributed over a period of time, normally 12 months. You can use the monthly disbursement data from the previous page to review how disbursements were broken up during the year:</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\\\"sb1SmallerFont\\\"><br />\r\n</p>\r\n<table border=\\\"1\\\" width=\\\"483\\\">\r\n    <tbody>\r\n        <tr>\r\n            <th width=\\\"98\\\" class=\\\"sb1SmallerFont\\\" scope=\\\"col\\\">Month</th>\r\n            <th width=\\\"7\\\" class=\\\"sb1SmallerFont\\\" scope=\\\"col\\\">Jan</th>\r\n            <th width=\\\"7\\\" class=\\\"sb1SmallerFont\\\" scope=\\\"col\\\">Feb</th>\r\n            <th width=\\\"7\\\" class=\\\"sb1SmallerFont\\\" scope=\\\"col\\\">Mar</th>\r\n            <th width=\\\"7\\\" class=\\\"sb1SmallerFont\\\" scope=\\\"col\\\">Apr</th>\r\n            <th width=\\\"7\\\" class=\\\"sb1SmallerFont\\\" scope=\\\"col\\\">May</th>\r\n            <th width=\\\"7\\\" class=\\\"sb1SmallerFont\\\" scope=\\\"col\\\">Jun</th>\r\n            <th width=\\\"7\\\" class=\\\"sb1SmallerFont\\\" scope=\\\"col\\\">Jul</th>\r\n            <th width=\\\"7\\\" class=\\\"sb1SmallerFont\\\" scope=\\\"col\\\">Aug</th>\r\n            <th width=\\\"14\\\" class=\\\"sb1SmallerFont\\\" scope=\\\"col\\\">Sep</th>\r\n            <th width=\\\"14\\\" class=\\\"sb1SmallerFont\\\" scope=\\\"col\\\">Oct</th>\r\n            <th width=\\\"14\\\" class=\\\"sb1SmallerFont\\\" scope=\\\"col\\\">Nov</th>\r\n            <th width=\\\"10\\\" class=\\\"sb1SmallerFont\\\" scope=\\\"col\\\">Dec</th>\r\n            <th width=\\\"10\\\" class=\\\"sb1SmallerFont\\\" scope=\\\"col\\\">Total</th>\r\n        </tr>\r\n        <tr>\r\n            <td>\r\n            <div align=\\\"right\\\" class=\\\"sb1SmallerFont\\\">Number Distributed</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\" class=\\\"sb1SmallerFont\\\">5</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\" class=\\\"sb1SmallerFont\\\">20</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\" class=\\\"sb1SmallerFont\\\">5</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\" class=\\\"sb1SmallerFont\\\">8</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\" class=\\\"sb1SmallerFont\\\">25</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\" class=\\\"sb1SmallerFont\\\">30+25</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\" class=\\\"sb1SmallerFont\\\">15</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\" class=\\\"sb1SmallerFont\\\">17</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\" class=\\\"sb1SmallerFont\\\">X</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\" class=\\\"sb1SmallerFont\\\">X</div>\r\n            </td>\r\n            <td>\r\n            <div align=\\\"right\\\" class=\\\"sb1SmallerFont\\\">30+40</div>\r\n            </td>\r\n            <td class=\\\"sb1SmallerFont\\\">0</td>\r\n            <td>\r\n            <div align=\\\"right\\\" class=\\\"sb1SmallerFont\\\">20</div>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p class=\\\"sb1SmallerFont\\\">Note that in the month of August there was a stock-out and no paracetamol could be distributed<br />\r\nduring September and October. For those months you can count disbursements as &quot;X.&quot; Note<br />\r\nalso that in December there was no distribution at all, but there was stock on the shelves. For<br />\r\nthis month, count disbursements as &quot;0.&quot;</p>\r\n<p class=\\\"sb1SmallerFont\\\"><br />\r\nFurther you must only count 10 months for the formula below, since there were 9 months when<br />\r\ndrugs were distributed, plus 1 month when there were drugs in stock but none were requested for    distribution. You should not include in the formula the months of September and October, since    stock-out of paracetamol occurred. Finally, divide the total number of paracetamol units<br />\r\nconsumed during the year by 10 (9 + 1 months).</p>', '0', '0', '0', '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('139', 'pop_so', '<html xmlns=\\\"http://www.w3.org/1999/xhtml\\\">\r\n<head>\r\n<meta http-equiv=\\\"Content-Type\\\" content=\\\"text/html; charset=utf-8\\\" />\r\n<title>Untitled Document</title>\r\n<link href=\\\"../../plmis_css/nn_proj.css\\\" rel=\\\"stylesheet\\\" type=\\\"text/css\\\" />\r\n</head>\r\n\r\n<body>\r\n<p class=\\\"sb1BlueRubric\\\">Stocked-Out</p>\r\n<p><img src=\\\"../../plmis_img/stockedout.jpg\\\" align=\\\"left\\\" /><span class=\\\"sb1SmallestFont\\\">Situation where the demand or requirement for an item cannot be fulfilled from the current (on hand) inventory at a facility or distribution level. Months of stock indicator is used to gauge the situation. For example, Condom is considered stocked-out if the months of stock of Condom fall below 5. </span></p>\r\n</body>\r\n</html>', '0', '0', '0', '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('140', 'pop_understocked', '<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<head>\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n<title>Untitled Document</title>\r\n<link href=\"../../plmis_css/nn_proj.css\" rel=\"stylesheet\" type=\"text/css\" />\r\n</head>\r\n\r\n<body class=\"sb1BlueRubric\">\r\n<p class=\"sb1BlueRubric\">Unserstocked\r\n</p>\r\n<p><img src=\"../../plmis_img/stockedout.jpg\" align=\"left\" /><span class=\"sb1SmallestFont\">Situation where the demand or requirement for an item cannot be fulfilled from the current (on hand) inventory at a facility or distribution level. Months of stock indicator is used to gauge the situation. For example, Condom is considered stocked-out if the months of stock of Condom fall below 5. </span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<table width=\"174\" border=\"1\">\r\n  <tr>\r\n    <td width=\"120\">Month</td>\r\n    <td width=\"5\">Jan</td>\r\n    <td width=\"5\">Feb</td>\r\n    <td width=\"5\">Mar</td>\r\n    <td width=\"5\">APr</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Consumption</td>\r\n    <td>2</td>\r\n    <td>3</td>\r\n    <td>6</td>\r\n    <td>8</td>\r\n  </tr>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"sb1NavBarOption\">Paklmis<br />\r\n  Paklmis<br />\r\n  <br />\r\n</p>\r\n</body>\r\n</html>\r\n', '0', '0', '0', '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('141', 'pop_more_nr', '<link type=\"text/css\" rel=\"stylesheet\" href=\"../../plmis_css/nn_proj.css\" />\r\n<p class=\"sb1BlueRubric\">National Summary Report</p>\r\n<p class=\"sb1SmallerFont\">The  national summary report not only provides the summary statistics but also opens  up various options for user to explore further into the data through various  links. Each commodity name is a hyperlink in the report and clicking on it will  guide the user to national report for that particular commodity. The national  report provides consumption, average monthly consumption, stock on hand, months  of stock and couple years of protection by each commodity for a particular  month. The data is summed up for all stakeholders in each commodity. The header  bar of report provides information on reporting rate (left side) and  availability rate (right side). By clicking on reporting rate user can view the  districts (by stakeholders) which have not reported for a particular month. If &ldquo;all&rdquo;  is selected from the option &ldquo;stakeholder&rdquo; all district level stakeholders not  reporting for a particular month will appear in the list. For example, a  district name will appear twice if both DPIU and DPWO have not reported. While  selecting a particular stakeholder will provide list of non-reporting districts  units for a particular stakeholder.</p>\r\n<p class=\"sb1SmallerFont\">By  clicking on availability rate, the months of stock for each district store are  shown. The availability rate for particular districts for a particular month by  stakeholder can filtered from the menu provided. Separate months of stock for  field and store are provided in addition to the aggregate for the two </p>', '0', '0', '0', '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('142', 'readme_nr', '<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<head>\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n<title>Untitled Document</title>\r\n<link href=\"plmis_css/nn_proj.css\" rel=\"stylesheet\" type=\"text/css\" />\r\n</head>\r\n\r\n<body>\r\n<h2><a name=\"_Toc275787605\" class=\"sb1BlueRubric\" id=\"_Toc275787605\">National summary report</a></h2>\r\n<p class=\"sb1SmallerFont\">This submenu allows authorized users to view reports in the system  through a user-friendly interface from the central Web-based system (as per  authentication), as shown in Figure 13. Â <br />\r\n  <img src=\"plmis_img/cms/pg_nr_clip_image002.gif\" alt=\"\" width=\"616\" height=\"144\" /> <br />\r\n  <a name=\"_Ref271792235\" id=\"_Ref271792235\">Figure </a>18 : Viewing reports <br />\r\n  An authorized user after a successful login is  presented with two tabs on left side of screen. These are LMIS reports and LMIS  data. After clicking on LMIS reports two options of Graphs and Reports are  shown. In the report submenu, the user can have access to reports from national  to district level. The display of reports is in a drill down fashion. The  national summary of all contraceptive commodities for the current reported  month is presented after clicking on &ldquo;National Summary Report&rdquo; as shown in Figure 15 below. </p>\r\n<p class=\"sb1SmallerFont\"><img src=\"plmis_img/cms/pg_nr_clip_image004.gif\" alt=\"\" width=\"633\" height=\"318\" /><br />\r\n  <a name=\"_Ref274830452\" id=\"_Ref274830452\">Figure </a>19 : National Summary Report<br />\r\n  The  national summary report not only provides the summary statistics but also opens  up various options for user to explore further into the data through various  links. Each commodity name is a hyperlink in the report and clicking on it will  guide the user to national report for that particular commodity. The national  report provides consumption, average monthly consumption, stock on hand, months  of stock and couple years of protection by each commodity for a particular  month. The data is summed up for all stakeholders in each commodity. The header  bar of report provides information on reporting rate (left side) and  availability rate (right side). By clicking on reporting rate user can view the  districts (by stakeholders) which have not reported for a particular month. If &ldquo;all&rdquo;  is selected from the option &ldquo;stakeholder&rdquo; all district level stakeholders not  reporting for a particular month will appear in the list. For example, a  district name will appear twice if both DPIU and DPWO have not reported. While  selecting a particular stakeholder will provide list of non-reporting districts  units for a particular stakeholder (Figure 20). <br />\r\n  <img src=\"plmis_img/cms/pg_nr_clip_image006.jpg\" alt=\"\" width=\"652\" height=\"465\" /> <br />\r\n  <a name=\"_Ref274833645\" id=\"_Ref274833645\">Figure </a>20 : Non-reporting districts by  stakeholder <br />\r\n  <img src=\"plmis_img/cms/pg_nr_clip_image008.gif\" alt=\"\" width=\"646\" height=\"235\" hspace=\"12\" align=\"left\" />By clicking on availability rate, the  months of stock for each district store are shown. The availability rate for  particular districts for a particular month by stakeholder can filtered from  the menu provided. Separate months of stock for field and store are provided in  addition to the aggregate for the two (Figure 21)</p>\r\n<p class=\"sb1SmallerFont\"><a name=\"_Ref275528124\" id=\"_Ref275528124\">Figure </a>21 : Item  availability report </p>\r\n<p class=\"sb1BlueRubric\">&nbsp;</p>\r\n</body>\r\n</html>\r\n', '0', '0', '0', '', '', '0', '', null);
