INSERT INTO `tbl_cms` VALUES ('146', 'Punjab P&D/Population Welfare Departments', '<p>The Population Program was launched in 1965 through Family Planning Council in the Centre and through Family Planning Boards in the Provinces. The Program was federalized in 1977.<br />\r\n<br />\r\nIn 1981, an Ordinance titled &quot;Population Welfare Planning Program (Appointment &amp; Termination of Service) Ordinance, 1981&quot; was promulgated. Under Section 3 &amp; 4 of the Ordinance, the services of the employees in BS-16 and above were regularized through Federal Public Services Commission (FPSC) and those in BS-1 to 15 through the respective Department Selection Committees.<br />\r\n<br />\r\nIn 1983, the field activities of the Population Program were transferred to the Provinces under the provisions of the Transfer of Population Welfare Program (Field Activities) Ordinance, 1983. The employees recruited by the Provinces were transferred to their respective Provincial Population Welfare Departments under Section-8 of Ordinance, 1983 and they were presumed to be employees of the Population Welfare Departments of the Provinces.<br />\r\n<br />\r\nIn 1983, however, the Supreme Court of Pakistan vide judgment in Civil Appeals Nos.292, 293/1991 dated 19-1-1993 declared the status of the program employees whose services were regularized under Ordinance, 1981 and subsequently transferred to the Provinces under the provisions of Ordinance, 1983 as the &quot;Civil Servants of the Federal Government&quot;.<br />\r\n<br />\r\nMeanwhile, on July 25, 2001 an Ordinance on &quot;Transfer of Population Welfare Program (Field Activities) (Amendment) Ordinance, 2001&quot; was promulgated, inter-alia, declaring all Population Program personnels working in four Provinces as Civil Servants of the respective Provincial Governments. All these employees working in Provincial Population Welfare Departments are now being governed by the rules and regulations made under the provincial laws relating to their Civil Servants.<br />\r\n<br />\r\nAt the Federal Level, Population Welfare Division was created in March 1968. It got the status of a full fledged Ministry of Population Welfare on 27th June, 1990.<br />\r\n<br />\r\nBased on the 18th Amendment, the Government of Pakistan devolved Ministry of Population Welfare as per the constitution in 2010. Keeping in mind the importance of Contraceptive Commodity Security, the Implementation Commission of Pakistan in consultation with the provinces decided to keep Population Program Wing (PPW) under the Planning &amp; Development Division, which is looked after by the Population &amp; Social Planning Section of P&amp;D. The Government of Pakistan has allocated PKR2.4 Billion for the procurement of contraceptives under this program to ensure continuity of contraceptive supplies.<br />\r\n<br />\r\nList of contraceptives<br />\r\n<br />\r\n1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Combined Oral Contraceptive (COC)<br />\r\n<br />\r\n2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Copper-T Intrauterine Device (IUD)<br />\r\n<br />\r\n3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Depot Medroxyprogesterone Acetate (DMPA)<br />\r\n<br />\r\n4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Emergency Contraceptive Pills (ECP)<br />\r\n<br />\r\n5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Implanon<br />\r\n<br />\r\n6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Jadelle<br />\r\n<br />\r\n7.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Male condom (generic)<br />\r\n<br />\r\n8.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Multiload<br />\r\n<br />\r\n9.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; NET-EN (2 month injection)<br />\r\n<br />\r\n10.&nbsp;&nbsp;&nbsp; POP (generic)</p>', '1', '0', null, 'Punjab P&D/Population Welfare Department', '', '1', '1363852798.JPG', null);
INSERT INTO `tbl_cms` VALUES ('147', 'Sindh P&D/Population Welfare Departments', '<p>The Population Program was launched in 1965 through Family Planning  Council in the Centre and through Family Planning Boards in the  Provinces. The Program was federalized in 1977.<br />\r\n<br />\r\nIn 1981, an Ordinance titled &quot;Population Welfare Planning Program  (Appointment &amp; Termination of Service) Ordinance, 1981&quot; was  promulgated. Under Section 3 &amp; 4 of the Ordinance, the services of  the employees in BS-16 and above were regularized through Federal Public  Services Commission (FPSC) and those in BS-1 to 15 through the  respective Department Selection Committees.<br />\r\n<br />\r\nIn 1983, the field activities of the Population Program were transferred  to the Provinces under the provisions of the Transfer of Population  Welfare Program (Field Activities) Ordinance, 1983. The employees  recruited by the Provinces were transferred to their respective  Provincial Population Welfare Departments under Section-8 of Ordinance,  1983 and they were presumed to be employees of the Population Welfare  Departments of the Provinces.<br />\r\n<br />\r\nIn 1983, however, the Supreme Court of Pakistan vide judgment in Civil  Appeals Nos.292, 293/1991 dated 19-1-1993 declared the status of the  program employees whose services were regularized under Ordinance, 1981  and subsequently transferred to the Provinces under the provisions of  Ordinance, 1983 as the &quot;Civil Servants of the Federal Government&quot;.<br />\r\n<br />\r\nMeanwhile, on July 25, 2001 an Ordinance on &quot;Transfer of Population  Welfare Program (Field Activities) (Amendment) Ordinance, 2001&quot; was  promulgated, inter-alia, declaring all Population Program personnels  working in four Provinces as Civil Servants of the respective Provincial  Governments. All these employees working in Provincial Population  Welfare Departments are now being governed by the rules and regulations  made under the provincial laws relating to their Civil Servants.<br />\r\n<br />\r\nAt the Federal Level, Population Welfare Division was created in March  1968. It got the status of a full fledged Ministry of Population Welfare  on 27th June, 1990.<br />\r\n<br />\r\nBased on the 18th Amendment, the Government of Pakistan devolved  Ministry of Population Welfare as per the constitution in 2010. Keeping  in mind the importance of Contraceptive Commodity Security, the  Implementation Commission of Pakistan in consultation with the provinces  decided to keep Population Program Wing (PPW) under the Planning &amp;  Development Division, which is looked after by the Population &amp;  Social Planning Section of P&amp;D. The Government of Pakistan has  allocated PKR2.4 Billion for the procurement of contraceptives under  this program to ensure continuity of contraceptive supplies.<br />\r\n<br />\r\nList of contraceptives<br />\r\n<br />\r\n1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Combined Oral Contraceptive (COC)<br />\r\n<br />\r\n2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Copper-T Intrauterine Device (IUD)<br />\r\n<br />\r\n3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Depot Medroxyprogesterone Acetate (DMPA)<br />\r\n<br />\r\n4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Emergency Contraceptive Pills (ECP)<br />\r\n<br />\r\n5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Implanon<br />\r\n<br />\r\n6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Jadelle<br />\r\n<br />\r\n7.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Male condom (generic)<br />\r\n<br />\r\n8.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Multiload<br />\r\n<br />\r\n9.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; NET-EN (2 month injection)<br />\r\n<br />\r\n10.&nbsp;&nbsp;&nbsp; POP (generic)</p>', '1', '0', null, 'Sindh P&D/Population Welfare Department', '', '2', '1363858309.JPG', null);
