INSERT INTO `tbl_cms` VALUES ('149', 'Guest', '<h2>Aligned with 18th Amendment, the Prime Minister of Pakistan launched \r\n        the LMIS and handed over \"Contraceptive Procurement Manual\" to the \r\n        federal, provincial and regional population and health departments on \r\n        the World Population Day 2011</h2>\r\n<p>The Prime Minister of Pakistan, launched the National Logistics Management Information System (LMIS) on the World Population Day, 11 July, 2011. The LMIS is the first web based health commodity information system catering the logistics management of health products for both population and health sectors.  The Pakistan LMIS is a powerful web-based Information Technology tool designed to enable the managers in day-to-day supply decision making. It helps ensure commodity security through data visibility, continuous monitoring and availability of Family Planning products at all levels.</p>\r\n<div class=\"clear2\"></div>\r\n                    <p>After exhaustive consultations, since 2010, the LMIS has been developed keeping in mind the logistics requirements of both public and private sectors. LMIS provides a real time information of commodity stocks and supplies thus preventing stock-outs and expiries. The system informs consumption trends and choices of family planning methods and drugs to ensure availability of health commodities at the last mile. The availability of real time data on stock balance and usage also help in forecasting and procurement planning. Inspired by the notion &minus; No Commodity No Program, the Population & Social Planning Section of Planning & Development Division housed the LMIS/Procurement Cell to monitor commodities at the CW&S, provincial, district and sub-district levels with technical assistance from USAID Pakistan. The LMIS informs policy makers, implementation planners, population/health managers and researchers on forecasting, accurate quantification, procurement planning, budgeting and responding to stock outs with a click of a button. Logistics being the physical determinant of health, the Pakistan LMIS will remain an important tool to avert maternal and child mortality by improving the supply chains of population and health sectors.</p>\r\n                    <p>Planning Commission of Pakistan along with line ministries and departments of population & health, spearheaded development of Pakistan\'s first \"Contraceptive Procurement Manual\". The manual endorsed by the Pakistan Procurement Regulatory Authority has the ability of adaptation for other health products. It enables Planning & Development Division to conduct international procurement of contraceptive independently. Aligned with Population & Social Planning Section of thePlanning Commission, the USAID | DELIVER PROJECT will provide training to nationwide \"procurement staff\" expected from August this year.</p>\r\n                    <div class=\"clear2\"></div>', '1', '1', null, 'Logistics Management Information System (LMIS) - Contraceptive', '', '0', 'pak_federal.jpg', null);
INSERT INTO `tbl_cms` VALUES ('150', 'P&D/Population Welfare Departments', '<p class=\"MsoNormal\">The Population Program was launched in 1965 through Family Planning Council in the Centre and through Family Planning Boards in the Provinces. The Program was federalized in 1977.</p>\r\n<p class=\"MsoNormal\">In 1981, an Ordinance titled &quot;Population Welfare Planning Program (Appointment &amp; Termination of Service) Ordinance, 1981&quot; was promulgated. Under Section 3 &amp; 4 of the Ordinance, the services of the employees in BS-16 and above were regularized through Federal Public Services Commission (FPSC) and those in BS-1 to 15 through the respective Department Selection Committees.</p>\r\n<p class=\"MsoNormal\">In 1983, the field activities of the Population Program were transferred to the Provinces under the provisions of the Transfer of Population Welfare Program (Field Activities) <a href=\"http://mopw.gov.pk/introduction.html\">Ordinance, 1983</a>. The employees recruited by the Provinces were transferred to their respective Provincial Population Welfare Departments under Section-8 of Ordinance, 1983 and they were presumed to be employees of the Population Welfare Departments of the Provinces.</p>\r\n<p class=\"MsoNormal\">In 1983, however, the Supreme Court of Pakistan vide judgment in Civil Appeals Nos.292, 293/1991 dated 19-1-1993 declared the status of the program employees whose services were regularized under Ordinance, 1981 and subsequently transferred to the Provinces under the provisions of Ordinance, 1983 as the &quot;Civil Servants of the Federal Government&quot;.</p>\r\n<p class=\"MsoNormal\">Meanwhile, on July 25, 2001 an Ordinance on &quot;Transfer of Population Welfare Program (Field Activities) (Amendment) Ordinance, 2001&quot; was promulgated, inter-alia, declaring all Population Program personnels working in four Provinces as Civil Servants of the respective Provincial Governments. All these employees working in Provincial Population Welfare Departments are now being governed by the rules and regulations made under the provincial laws relating to their Civil Servants.</p>\r\n<p class=\"MsoNormal\">At the Federal Level, Population Welfare Division was created in March 1968. It got the status of a full fledged Ministry of Population Welfare on 27th June, 1990.</p>\r\n<p class=\"MsoNormal\">Based on the 18th Amendment, the Government of Pakistan devolved  Ministry of Population Welfare as per the constitution in 2010. Keeping  in mind the importance of Contraceptive Commodity Security, the  Implementation Commission of Pakistan in consultation with the provinces  decided to keep Population Program Wing (PPW) under the Planning &amp;  Development Division, which is looked after by the Population &amp;  Social Planning Section of P&amp;D. The Government of Pakistan has  allocated PKR2.4 Billion for the procurement of contraceptives under  this program to ensure continuity of contraceptive supplies.</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt;\"><strong style=\"\"><font size=\"2\">List of contraceptives<o:p></o:p></font></strong></p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent: -0.25in; margin: 0in 0in 0pt 0.5in;\"><font size=\"2\"><span style=\"\"><span style=\"\">1.<span style=\"font: 7pt \'Times New Roman\';\"><font face=\"Arial\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font></span></span></span>Combined Oral Contraceptive (COC)</font></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -0.25in; margin: 0in 0in 0pt 0.5in;\"><font size=\"2\"><span style=\"\"><span style=\"\">2.<span style=\"font: 7pt \'Times New Roman\';\"><font face=\"Arial\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font></span></span></span>Copper-T Intrauterine Device (IUD)</font></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -0.25in; margin: 0in 0in 0pt 0.5in;\"><font size=\"2\"><span style=\"\"><span style=\"\">3.<span style=\"font: 7pt \'Times New Roman\';\"><f