INSERT INTO `tbl_cms` VALUES ('163', 'GS sindh', '<p class=\"MsoNormal\"><b>Introduction: </b>\r\n<p class=\"MsoNormal\">Greenstar Social Marketing Pakistan (Guarantee) Limited is a nonprofit, non-governmental organization devoted to improving quality of life among low-income people. \r\n<p class=\"MsoNormal\">A non-governmental organization, Greenstar works through the private sector and with the Government of Pakistan, empowering healthier choices and improving access to affordable, high-quality health products and services.<br />\r\n<br />\r\nFollowing the Government of Pakistan, Greenstar is the country&rsquo;s second-largest family planning provider. Having achieved significant progress in building the country&rsquo;s network of private &ldquo;trustworthy family planning service providers,&rdquo; in 2005 Greenstar launched a broader network of private &ldquo;family healthcare providers&rdquo; under the name &ldquo;GoodLife.&rdquo;<br />\r\n<br />\r\nGreenstar&rsquo;s Sabz Sitara portfolio has become synonymous with high quality, affordable family planning in Pakistan. The GoodLife portfolio addresses a broader spectrum of family health needs &ndash; including maternal and child health issues such as safe water, nutrition and malaria, and infectious diseases such as HIV and TB. </p>\r\n<p class=\"MsoNormal\"><br />\r\n<strong>Mission</strong><br />\r\n<span style=\"\">To improve the quality of life among people throughout Pakistan by increasing access to and use of health products, services and information, particularly in the lower socio-economic population groups.</span></p>', '5', '1', '1', 'Greenstar Social Marketing Pakistan (Guarantee) Limited ', '', '2', 'pak_federal.jpg', null);
INSERT INTO `tbl_cms` VALUES ('164', 'P&D/Population Welfare Department', '<p class=\"MsoNormal\">The Population Program was launched in 1965 through Family Planning Council in the Centre and through Family Planning Boards in the Provinces. The Program was federalized in 1977.</p>\r\n<p class=\"MsoNormal\">In 1981, an Ordinance titled &quot;Population Welfare Planning Program (Appointment &amp; Termination of Service) Ordinance, 1981&quot; was promulgated. Under Section 3 &amp; 4 of the Ordinance, the services of the employees in BS-16 and above were regularized through Federal Public Services Commission (FPSC) and those in BS-1 to 15 through the respective Department Selection Committees.</p>\r\n<p class=\"MsoNormal\">In 1983, the field activities of the Population Program were transferred to the Provinces under the provisions of the Transfer of Population Welfare Program (Field Activities) <a href=\"http://mopw.gov.pk/introduction.html\">Ordinance, 1983</a>. The employees recruited by the Provinces were transferred to their respective Provincial Population Welfare Departments under Section-8 of Ordinance, 1983 and they were presumed to be employees of the Population Welfare Departments of the Provinces.</p>\r\n<p class=\"MsoNormal\">In 1983, however, the Supreme Court of Pakistan vide judgment in Civil Appeals Nos.292, 293/1991 dated 19-1-1993 declared the status of the program employees whose services were regularized under Ordinance, 1981 and subsequently transferred to the Provinces under the provisions of Ordinance, 1983 as the &quot;Civil Servants of the Federal Government&quot;.</p>\r\n<p class=\"MsoNormal\">Meanwhile, on July 25, 2001 an Ordinance on &quot;Transfer of Population Welfare Program (Field Activities) (Amendment) Ordinance, 2001&quot; was promulgated, inter-alia, declaring all Population Program personnels working in four Provinces as Civil Servants of the respective Provincial Governments. All these employees working in Provincial Population Welfare Departments are now being governed by the rules and regulations made under the provincial laws relating to their Civil Servants.</p>\r\n<p class=\"MsoNormal\">At the Federal Level, Population Welfare Division was created in March 1968. It got the status of a full fledged Ministry of Population Welfare on 27th June, 1990.</p>\r\n<p class=\"MsoNormal\">Based on the 18th Amendment, the Government of Pakistan devolved  Ministry of Population Welfare as per the constitution in 2010. Keeping  in mind the importance of Contraceptive Commodity Security, the  Implementation Commission of Pakistan in consultation with the provinces  decided to keep Population Program Wing (PPW) under the Planning &amp;  Development Division, which is looked after by the Population &amp;  Social Planning Section of P&amp;D. The Government of Pakistan has  allocated PKR2.4 Billion for the procurement of contraceptives under  this program to ensure continuity of contraceptive supplies.</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt;\"><strong style=\"\"><font size=\"2\">List of contraceptives<o:p></o:p></font></strong></p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent: -0.25in; margin: 0in 0in 0pt 0.5in;\"><font size=\"2\"><span style=\"\"><span style=\"\">1.<span style=\"font: 7pt \'Times New Roman\';\"><font face=\"Arial\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font></span></span></span>Combined Oral Contraceptive (COC)</font></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -0.25in; margin: 0in 0in 0pt 0.5in;\"><font size=\"2\"><span style=\"\"><span style=\"\">2.<span style=\"font: 7pt \'Times New Roman\';\"><font face=\"Arial\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font></span></span></span>Copper-T Intrauterine Device (IUD)</font></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -0.25in; margin: 0in 0in 0pt 0.5in;\"><font size=\"2\"><span style=\"\"><span style=\"\">3.<span style=\"font: 7pt \'Times New Roman\';\"><font face=\"Arial\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font></span></span></span>Depot Medroxyprogesterone Acetate (DMPA)</font></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -0.25in; margin: 0in 0in 0pt 0.5in;\"><font size=\"2\"><span style=\"\"><span style=\"\">4.<span style=\"font: 7pt \'Times New Roman\';\"><font face=\"Arial\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font></span></span></span>Emergency Contraceptive Pills (ECP)</font></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -0.25in; margin: 0in 0in 0pt 0.5in;\"><font size=\"2\"><span style=\"\"><span style=\"\">5.<span style=\"font: 7pt \'Times New Roman\';\"><font face=\"Arial\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font></span></span></span>Implanon</font></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -0.25in; margin: 0in 0in 0pt 0.5in;\"><font size=\"2\"><span style=\"\"><span style=\"\">6.<span style=\"font: 7pt \'Times New Roman\';\"><font face=\"Arial\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font></span></span></span>Jadelle</font></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -0.25in; margin: 0in 0in 0pt 0.5in;\"><font size=\"2\"><span style=\"\"><span style=\"\">7.<span style=\"font: 7pt \'Times New Roman\';\"><font face=\"Arial\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font></span></span></span>Male condom (generic)</font></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -0.25in; margin: 0in 0in 0pt 0.5in;\"><font size=\"2\"><span style=\"\"><span style=\"\">8.<span style=\"font: 7pt \'Times New Roman\';\"><font face=\"Arial\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font></span></span></span>Multiload</font></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -0.25in; margin: 0in 0in 0pt 0.5in;\"><font size=\"2\"><span style=\"\"><span style=\"\">9.<span style=\"font: 7pt \'Times New Roman\';\"><font face=\"Arial\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font></span></span></span>NET-EN (2 month injection)</font></p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-indent: -0.25in; margin: 0in 0in 10pt 0.5in;\"><font size=\"2\"><span style=\"\"><span style=\"\">10.<span style=\"font: 7pt \'Times New Roman\';\"><font face=\"Arial\">&nbsp;&nbsp; </font></span></span></span>POP (generic)</font></p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-indent: -0.25in; margin: 0in 0in 10pt 0.5in;\"><font size=\"2\"></font> <br />\r\n</p>', '1', '1', null, 'P&D/Population Welfare Department', '', '8', 'pak_federal.jpg', null);
INSERT INTO `tbl_cms` VALUES ('165', 'District Stock Yearly Report', 'This report provides the district wise information about the issued stock, received stock, consumption and quantity on hand of the selected product.', '0', '0', null, '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('166', 'Field Stock Availibility Report', 'This report provides the information about the average monthly consumption (AMC), quantity on hand of all products and month of stock (MOS) for each product at health facility level.', '0', '0', null, '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('167', 'Reported Stores/Facilities Report', 'This Report provides the reporting rate of District Stores, Field Stores and Health Facilities which have reported or not reported for a particular month. If \"all\" is selected from the option \"Type\", all level stakeholders for a particular month will appear in the list. This report also provides the list of on-time and late reported Stores/Facilities.', '0', '0', null, '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('168', 'Quarterly Reporting Rate', 'This report provides the Stakeholder wise Reporting Rate for each month of the selected quarter of a year at Provincial Level.', '0', '0', null, '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('169', 'Provincial Reporting Rate', 'This report provides the Province wise reporting rates of District Stores, Field Stores and Overall Reporting Rates for the public sector stakeholders.', '0', '0', null, '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('170', 'Projected Contraceptive Requirement ', 'This report provides the projected contraceptive requirement for a selected product in each district based on the previous consumption of the product. The report shows average monthly consumption (AMC), stock available in the district store, at the field and sum of the two for the selected ending month. It also shows desired stock level for 3 months and the requested replenishment stock for the selected store.', '0', '0', null, '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('171', 'Central/Provincial Warehouse Report', 'This report provides the monthly values of different inventory indicators i.e. Issued, Stock on Hand and received stock of stakeholder\'s central or provincial warehouse / stores.', '0', '0', null, '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('172', 'Provincial Yearly Report', 'This report provides the provincial yearly report month for the selected stakeholder, indicator and year. There are five main indicators that can be viewed i.e. Issuance (Consumption), Couple Years of Protection (CYP), Stock on Hand and Received (District and Field). This report shows the aggregate of the selected Indicator from district and field.', '0', '0', null, '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('173', 'Private Sector Yearly Report', 'This report provides the monthly values of different inventory indicators i.e. Consumption, Stock on Hand and received stock for private sector stakeholder\'s warehouses/stores in a particular month.', '0', '0', null, '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('174', 'Public Private Sector Report', 'This report provides the public and private sector share of some indicators i.e. Consumption, AMC, Stock on Hand and MOS at National, Provincial, District and Field level.', '0', '0', null, '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('175', 'Provincial Monthly Stock Sufficiency Report', 'This report provides the information about the product wise month of stock(MOS) at district level, field level and overall MOS at each district of the selected province.', '0', '0', null, '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('176', 'Stock Issuance Status Report', 'This report provides the information about the stock issued by the central warehouse across the country.', '0', '0', null, '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('177', 'Shipment Report', 'This report provides the information about the total number of Issue Vouchers and Receive Vouchers by a Central, Provincial or District Store.', '0', '0', null, '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('178', 'Contraceptive Distribution Report', 'This report provides the information about the stock distributed by Transportation Mode across the country.', '0', '0', null, '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('179', 'Health Facility Wise Compliance Report', 'This report provides the information about the monthly reporting status of each health facility in a district over the whole year.', null, '0', null, '', '', '0', '', null);
INSERT INTO `tbl_cms` VALUES ('180', 'District Wise Compliance Report', 'This report provides the monthly reporting status of district store and reporting rate of the health facilities in that district over the whole year.', null, '0', null, '', '', '0', '', null);
